C\\\",\\\"VG\\\",\\\"YT\\\"]\"', NULL, '[\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"dad9da87-890f-427f-9d9b-aa928841ce09\"]', '\"[\\\"42c36461-beca-4c52-9570-375bb129e816\\\",\\\"643459ce-2619-4819-8a3d-b319aab69d27\\\",\\\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\\\",\\\"901c1214-e315-4269-b691-e7e23124bb5f\\\",\\\"539a1d2f-fc6e-4082-844a-cdbe6517efed\\\",\\\"6857ddf2-e55c-4640-b194-204950ab2ef8\\\",\\\"b3c43963-4397-414e-ad68-19c161924ef1\\\",\\\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\\\",\\\"efced686-40b0-446a-8c7b-96a0610e8372\\\",\\\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\\\",\\\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\\\",\\\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\\\",\\\"35224500-7f53-44ce-a774-d5e2299b9f95\\\",\\\"c88534a9-07a1-4153-b2d3-7c784897d752\\\",\\\"2c50b44b-cddd-4685-8db7-6511bde6cd38\\\",\\\"81864390-a660-477c-82f8-89b3509b7df7\\\",\\\"965a312f-f3f4-424c-af32-632860fba509\\\",\\\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\\\",\\\"6e704421-6015-49fd-ba15-f946556e6e62\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\\\",\\\"675670ac-6c51-45cb-bb40-1b16849e9d98\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\"]\"', NULL, NULL, 'Для трафика из стран СНГ (без Украины) создана отдельная партнерская программа AliExpress RU&CIS NEW. Заказы с кликом и со страной доставки СНГ не регистрируются в программе. Если большая часть вашего трафика (больше 50%) за прошедший календарный месяц была получена по странам из региона RU&CIS, то следует перевести весь трафик в оффер AliExpress RU&CIS NEW.\r\n\r\nСписок еженедельных акций.\r\n\r\nСписок неаффилиатных магазинов, за товары которых не выплачивается вознаграждение для заказов из всех стран вне зависимости от типа трафика вебмастера.\r\n\r\nAliExpress – один из крупнейших мировых маркетплейсов, предлагающий клиентам самые низкие цены, а также выбор из более чем 100 миллионов товаров от 200 тысяч продавцов, 20 самых популярных способов оплаты и доставку в более чем 200 стран.\r\n\r\nПреимущества для веб-мастеров:\r\n\r\n\r\n	Процент подтверждения более 90%\r\n	Мировая известность бренда\r\n	Нет ограничений по ГЕО\r\n	Бесплатная/дешевая доставка\r\n	Принимаются все основные виды оплат\r\n	Высокие тарифы\r\n\r\n\r\nПреимущества для покупателей:\r\n\r\n\r\n	Более 100 млн. товаров\r\n	Более 200 тыс. продавцов\r\n	Низкие цены\r\n	Бесплатная доставка практически на все товары\r\n	Более 20 способов оплаты\r\n	Безопасные переводы: продавец получает деньги только после подтверждения заказа\r\n	Клиентская поддержка 24/7\r\n	Мультиязычные сайты AliExpress\r\n\r\n\r\nТарифы\r\n\r\nВ партнерской программе Aliexpress WW работают следующие правила начисления комиссии за заказы с доставкой в Украину и остальные страны, кроме СНГ, для вебмастеров со следующими видами трафика: кэшбэк-сервисы, браузерные расширения, дропшиппинг-сервисы, партнерские сети:\r\n\r\n1. Вознаграждение не начисляется за неаффилиатные товары, такие заказы не будут отображаться в статистике. \r\n\r\n2. Для дропшиппинга: трекинг будет осуществляться только при заказе товара, на который вела партнерская ссылка, или при заказе других товаров этого же продавца. Повышенная комиссия за Hot Products не начисляется. \r\n\r\n-Для заказов со страной доставки Бразилия неаффилиатные продукты категории «Компьютер и офис», комиссия составляет 0%,.\r\n\r\n-Для компаний, занимающихся дропшиппингом, ваша комиссия будет меняться в зависимости от того, что продавцы устанавливают в партнерской программе, в то же время вам будет разрешено получать оплату за Hot Products с более высокими комиссиями.\r\n\r\n3. Если у вас есть собственный пул веб-мастеров, которые работают через ваш аккаунт (модель “сабнетворк“),  повышенная комиссия за Hot Products не начисляется;\r\n\r\n4. Для всех видов трафика для продавцов из данного списка на AliExpress ставка составит 0,75%. Просим обратить внимание, что данный список не является финальным и не обновляется в режиме реального времени. Магазины могут быть добавлены или удалены из этого списка. Мы стараемся поддерживать список магазинов в актуальном виде.\r\n\r\nОбращаем ваше внимание, что определение вида трафика вебмастера происходит на основе заявленного типа трафика и указанной площадки при подаче заявки на подключение к офферу. Из-за особенностей модерации на AliExpress первые 3-5 дней работы с оффером вебмастер может находиться на проверке в отделе контроля AliExpress, в течение данного времени вебмастеру недоступны повышенные ставки за Hot Products, а также не выплачивается вознаграждение за неаффилиатные товары.\r\n\r\nВ случае, если вебмастер работает с партнерской программой AliExpress по нескольким площадкам под одним логином, одной из которых является кэшбэк-сервис, расширение или дропшиппинг-сервис, пожалуйста, свяжитесь с нашей службой поддержки в тикетах.\r\n\r\nПравила начисления комиссии для других видов трафика:\r\n\r\n\r\n	\r\n		\r\n			\r\n			Тип трафика\r\n			\r\n			\r\n			Остальные виды трафика\r\n			\r\n			\r\n			Cashback / Браузерные расширения\r\n			\r\n			\r\n			Дропшиппинг\r\n			\r\n			\r\n			Партнерские сети\r\n			\r\n		\r\n		\r\n			\r\n			Ставки за аффилиатные товары\r\n			\r\n			\r\n			Стандартная ставка\r\n			\r\n			\r\n			3.40%-8.00%-10.30% (размер повышения не больше $4)\r\n			\r\n			\r\n			2% - 4%\r\n			\r\n			\r\n			Стандартная ставка\r\n			\r\n		\r\n		\r\n			\r\n			Ставки за неаффилиатные товары\r\n			\r\n			\r\n			Стандартная ставка\r\n			\r\n			\r\n			0%\r\n			\r\n			\r\n			0%\r\n			\r\n			\r\n			0%\r\n			\r\n		\r\n		\r\n			\r\n			Повышенная ставка за Hot Products\r\n			\r\n			\r\n			да\r\n			\r\n			\r\n			да\r\n			\r\n			\r\n			Стандартная ставка\r\n			\r\n			\r\n			нет\r\n			\r\n		\r\n		\r\n			\r\n			Атрибуция\r\n			\r\n			\r\n			приоритет при продвижении отдельных товаров\r\n			\r\n			\r\n			приоритет при продвижении отдельных товаров\r\n			\r\n			\r\n			заказ только из магазина, на который вела ссылка\r\n			\r\n			\r\n			при