n		\r\n		\r\n			\r\n			Special category (virtual products)*\r\n			\r\n			\r\n			0%\r\n			\r\n		\r\n	\r\n\r\n\r\n* Специальная категория - виртуальные продукты, включенные в специальную категорию, не включены в партнерскую программу и по ним не выплачивается комиссия. Категория виртуальных продуктов включает, но не ограничивается следующими видами продуктов: подарочные карты и сертификаты, купоны, предоплаченные коды, билеты, программное обеспечение и игры, цифровые книги. Рекламодатель оставляет за собой право определять относится ли продукт к виртуальным продуктам при расчете комиссии.\r\n\r\n** AliExpress принял решение об изменении ставок за заказы, совершенные у продавцов из данного списка. Комиссия за такие заказы составит 0,75%. В список магазины, продающие электронику брендов Xiaomi, Huawei, Honor, UMIDIGI, Meizu, OnePlus, Lenovo и другие. AliExpress оставляет за собой право пополнять данный список продавцов. Обратите внимание, что некоторые товары в данных магазинах являются неаффилиатными (то есть AliExpress не выплачивает за них комиссию). \r\n\r\nКомиссия за товары из магазина CHUWI Global - Flagship Store составляет 1,5% для заказов из всех стран.\r\n\r\nМаксимальное вознаграждение за оплаченный заказ составляет $38. \r\n\r\nHot Products\r\n\r\n Основное правило начисления вознаграждения за Hot Products: переход должен быть осуществлен по рекламному материалу из инструмента/фида Hot Product или по ссылке, сгенерированной Admitad Bot. В случае если переход был осуществлен по основной ссылке (ru.aliexpress.com, aliexpress.com) или по ссылке на обычный товар, будет применено стандартное вознаграждение.\r\n\r\nХотим обратить ваше внимание на внесение изменений в правила атрибуции для Hot Products. Подробнее с новыми правилами атрибуции можно ознакомиться здесь.\r\n\r\nВы можете найти фид Hot Products в разделе “Товары” в меню программы.\r\n\r\nУведомляем вас об изменении политики AliExpress в отношении расширений браузера (plug-ins, add-ons, extensions) и подобных программных модулей, которые вносят изменения или влияют на работу веб-страниц AliExpress (действует для всех ГЕО):\r\n\r\n\r\n	Расширениям браузера (plug-ins, add-ons, extensions) и подобным программным модулям запрещается автоматически открывать всплывающие окна (pop-up) и любые типы уведомлений на сайте AliExpress как в момент открытия пользователем сайта AliExpress, так и в процессе перемещения по нему. Только уведомления внутри иконки плагина (см. фото) являются допустимыми. Кроме того, расширениям запрещается модифицировать код сайта AliExpress, включая, но не ограничиваясь, встраиванием своих кнопок/текстовых блоков куда бы то ни было в сайт AliExpress.\r\n\r\n\r\nРекомендации по размещению ссылок на аффилиатные товары (товары продавцов AliExpress, которые участвуют в партнерской программе):\r\n\r\n\r\n	Использование основной партнерской ссылки оффера из вашего личного кабинета. Основная ссылка ведет на best.aliexpress.com - это вариант главной страницы AliExpress, где все товары являются аффилиатными. \r\n	Если вы продвигаете отдельные товары, вы сможете проверить их на аффилиатность с помощью инструмента \"Тестер ссылок\" в личном кабинете Admitad. Туда необходимо вставить партнерский диплинк, если товар не является аффилиатным, появится соответствующее предупреждение. Кроме того, аффилиатность товара можно проверить с помощью нашего API в два шага:\r\n\r\n\r\n\r\n	Пользователь проверяет прямую ссылку на товар. Из прямой ссылки веб-мастеру необходимо сгенерировать партнерскую с помощью метода Генератор deeplink https://developers.admitad.com/ru/doc/api_ru/methods/deeplink/deeplink/.\r\n	Проверить партнерскую ссылку с помощью метода Тестирование ссылок https://developers.admitad.com/ru/doc/api_ru/methods/links/links/. Если ссылка ведет на аффилиатный товар, АПИ вернет ответ \"Ссылка успешно протестирована\". Если ссылка ведет на неаффилиатный товар, АПИ вернет ответ \"Внимание, данный товар не является аффилиатным\".\r\n\r\n\r\n\r\n	Вы также можете брать ссылки из товарных фидов AliExpress, там содержатся только аффилиатные товары. \r\n\r\n\r\nБолее подробно ознакомиться с информацией об Антиспам отчетах от Aliexpress вы можете ознакомиться здесь.\r\n\r\nСписок минус слов вы можете скачать по ссылке\r\n\r\nОбратите внимание, что контекст на бренд строго запрещен. Вы не можете использовать название бренда Aliexpress в качестве ключевого слова, в том числе название бренда, написанное с ошибкой, написанное частично или в сочетании с другим словом.\r\n\r\nGuide - How to Make Money With AliExpress – Trusted Ways', NULL, 'https://www.aliexpress.com/', 'https://rzekl.com/g/1e8d11449452e070baaf16525dc3e8/', NULL, 'api', '2024-10-23 06:08:13', '2025-01-26 23:00:07', NULL, 'bf159005-f7a7-4c6f-aff1-a25f503e6c2e', NULL),
