n\r\nВсе самые свежие акции можно найти в данном файле (обновляется ежедневно)!\r\n\r\nGEEKBUYING гарантирует:\r\n\r\n\r\n	Оригинальные товары по конкурентоспособным ценам\r\n	100% строгий контроль качества и ускоренная доставка\r\n	Бесплатная доставка надежными посредниками\r\n	Отличная репутация в сфере обслуживания клиентов\r\n	1 год гарантии на бесплатный ремонт\r\n	Принципы безопасных платежей и конфиденциальности информации\r\n\r\n\r\nЦелевая аудитория: мужчины в возрасте от 18 до 45 лет.\r\n\r\nОписание категорий по ставкам:\r\n\r\n\r\n	Category 1:  Computers, Tablets & Accessories, Security System，Smart Home & Garden，Consumer Electronics，Automobiles & Motorcycles  - 5%\r\n	Category 2: Sports & Outdoors - 6%\r\n	Category 3: Fashion  - 8%\r\n	Category 4: Phones & Accessories 2%\r\n	Other categories: TV Boxes & Mini PCs, Toys & Hobbies, Wearable Devices - 4%\r\n	Order from APP - 4%\r\n\r\n\r\nс уважением,\r\nпартнерская программа Geekbuying.com', NULL, 'https://www.geekbuying.com/', 'https://bywiola.com/g/78tuvzaw8k52e070baaf0267b86f6e/', NULL, 'api', '2024-10-23 06:08:13', '2024-10-29 17:30:02', NULL, NULL, NULL),
('ab4c6e7f-9c90-45ed-928f-3e41c6fa7d30', NULL, 15711, 16990593, NULL, 'Займер (CPS) KZ', 'KZT', '28', NULL, '6580', NULL, NULL, 'Admitad', 'logos/cpskz.svg', 'https://cdn.admitad-connect.com/campaign/images/2023/7/21/15711-c2ebd2bf5d9d6120.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '12800', '1280000KZT', '30', 0, 0, 0, 0, 1, 0, NULL, '[\"Kazakhstan\"]', '\"[\\\"b55c8bae-fe47-419d-ad39-602767326bd3\\\",\\\"d1639324-9fde-494a-b902-6a3e4c0edd0d\\\",\\\"0d6a7c0b-bffe-483c-9948-2e058d77a199\\\"]\"', '\"[\\\"KZ\\\"]\"', NULL, '[\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\"]', '\"[\\\"643459ce-2619-4819-8a3d-b319aab69d27\\\",\\\"2c50b44b-cddd-4685-8db7-6511bde6cd38\\\",\\\"42c36461-beca-4c52-9570-375bb129e816\\\"]\"', NULL, NULL, '\"Займер\" – это надежная микрофинансовая компания, которая ведет всю свою деятельность в онлайн, а также в офлайн режиме и выдает микрокредиты онлайн на территории всего Казахстана.\r\n\r\nВАЖНО: Для недопущения введения в заблуждение граждан, Закон вводит обязанность МФО указывать ГЭСВ при распространении и размещении рекламы. \r\n\r\n\r\n	Просьба при распространении/размещении рекламы, на витринах и рекламных материалах, где будет указываться оффер Zaimer KZ прописать текст о ставке с ГЭСВ!\r\n	Текст: Ставка от 0.01% (ГЭСВ от 0.12%)\r\n\r\n\r\nПри создании креативов, теперь обязательно указывать ГЭСВ. Просто строчкой.\r\n\r\n\r\n	если каз. вариант, то\"ЖТСМ-0,12%\r\n	если русский язык - \"ГЭСВ-0,12%\"\r\n\r\n\r\nВАЖНО! В оффере Займер [CPS] KZ в связи с изменением законодательства Казахстана:\r\n\r\n\r\n	\r\n	Запрещено, вести контекстную рекламу на ленд рекламодателя по запросам \"займ\",  \"заем\" или \"кредит\". Для прямой рекламы используйте формулировку \"Микрокредит\".\r\n	\r\n	\r\n	При показе объявлений, ведущих на витрины, формулировки \"займ\", \"заем\" или \"кредит\" можно использовать. \r\n	\r\n	\r\n	На своих витринах необходимо заменить слово \"заем\" на \"микрокредит\".\r\n	\r\n\r\n\r\nТребования к рекламным материалам.\r\n\r\n\r\n	На всех баннерах и на лендинге должен быть указан номер лицензии \"АРРФР(ҚНРДА) № 02.21.0032.М\"\r\n\r\n\r\nФормулировку \"бесплатный\" использовать запрещается.\r\n\r\nКраткое описание оффера:\r\n\r\n\r\n	Сумма микрокредита: от 10 000 до 250 000 тенге;\r\n	Срок микрокредита: от 7 до 30 дней;\r\n	Процентная ставка для новых клиентов: от 0,01% (ГЭСВ 0,12%).\r\n\r\n\r\n Требования к заемщику:\r\n\r\n\r\n	Возраст: от 18 до 75 лет включительно;\r\n	Гражданство: Республики Казахстана и действующее удостоверение личности;\r\n	Активный номер мобильного телефона и адрес электронной почты;\r\n	Постоянный доход.\r\n\r\n\r\nСпособы получения:\r\n\r\n\r\n	На банковскую карту (24/7, в течение 10 минут);\r\n	Перевод на банковский счет (от 20 минут до 3 банковских рабочих дней);\r\n	Наличные (в отделениях).\r\n\r\n\r\nСпособы погашения:\r\n\r\n\r\n	Банковской картой в личном кабинете;\r\n	В филиале любого банка, банковским переводом, на банковский счет;\r\n	Касса 24, Qiwi, Yurta, Paydala;\r\n	Наличными (в отделениях);\r\n	Мобильное приложение \"Halyk\".\r\n\r\n\r\nДополнительные возможности:\r\n\r\n\r\n	Первый микрокредит по ставке от 0,01% годовых (ГЭСВ не более 56% годовых);\r\n	Досрочное погашение микрокредита;\r\n	Доступна услуга рефинансирования, чтобы не выйти на просрочку.\r\n\r\n\r\nПреимущества для клиентов:\r\n\r\n\r\n	Микрокредиты онлайн доступны для Вас 24 часа в сутки, 7 дней в неделю, 365 дней в году;\r\n	Возможность оформить микрокредит онлайн, и получить деньги наличными в точках выдачи в Астане, Алматы, Караганде, Темиртау, Семей, Таразе, Павлодаре и других населенных пунктах. Время от оформления заявки до получения денег – 15 минут;\r\n	Возможность оформить микрокредит в любой точке Казахстана;\r\n	Современные технологические решения, высококвалифицированные специалисты, контактный центр, который работает круглосуточно;\r\n	Программа лояльности, промокоды, регулярные акции;\r\n	Отсутствие залога и поручителя.\r\n\r\n\r\n✅  Разрешенный вид трафика:\r\n\r\n\r\n	SMS-рассылки (по согласованию);\r\n	E-mail-рассылки;\r\n	Витринные сайты;\r\n	Контекстная реклама;\r\n	SEO трафик;\r\n	Медийная реклама в сети:\r\n	\r\n		Баннера;\r\n		Видеореклама;\r\n		Текстово-графические блоки.\r\n	\r\n	\r\n	Публичная страница, группа, сообщество, реклама в социальных сетях;\r\n	Таргетированная реклама;\r\n	Push-уведомления;\r\n	ClickUnder;\r\n	PopUnder;\r\n	Тизерная сеть;\r\n	Гиперконтекстная реклама;\r\n	Реброкеринг / Брокерский трафик;\r\n	Ретаргетинг;\r\n	Приложения и игры (кроме web-view);\r\n	Реклама блогеров (по согласованию);\r\n\r\n\r\n❌ Запрещенный вид трафика:\r\n\r\n\r\n	Контекстная реклама по брендовым запросам, по основным запросам, с использованием бренда в креативе, и по запросам конкурентов.\r\n	Контекстная реклама, которая ведет на страницу бренда;\r\n	Мимикрия сайта, социальных сетей и рекламных объявлений;\r\n	Мислид;\r\n	Type-in;\r\n	 Спам:\r\n	\r\n		SMS-рассылки;\r\n		E-mail-рассылки;\r\n		Звонки/Дозвоны;\r\n		Push-уведомления.\r\n	\r\n	\r\n	Cookie stuffing:\r\n	\r\n		Toolbar;\r\n		Iframe реклама;\r\n		Подмена доменов;\r\n		Склейкой доменов и редиректов;\r\n		Изменённые настройки общественной Wi-Fi сети.\r\n	\r\n	\r\n	Мотивированный трафик:\r\n	\r\n		Контент-локер (content locker);\r\n		Биржи заданий (microtask websites);\r\n		Денежное вознаграждение (money incentivized);\r\n		Cashback трафик.\r\n	\r\n	\r\n	PopUp реклама;\r\n	Adult / Порно-трафик;\r\n	Дорвейный трафик;\r\n	Партизанский маркетинг;\r\n	Корегистрация.\r\n\r\n\r\n----------\r\n\r\nДля оперативного информирования об изменениях и новостях, подписывайтесь на телеграм-канал Адмитад Казахстан!', NULL, 'https://zaimer.kz/', 'https://plrvq.com/g/jz091vjl2s52e070baaf6ed4b4f1db/', NULL, 'api', '2024-10-23 06:08:13', '2025-01-26 23:00:06', NULL, 'ab4c6e7f-9c90-45ed-928f-3e41c6fa7d30', NULL),
