prezentatywny przykład pożyczki internetowej na dzień 05.10.2023r.:\r\nDla przykładowej pożyczki na kwotę 1 000 zł na 30 dni RRSO, tj. Rzeczywista Roczna Stopa Oprocentowania wynosi 312,03%, przy założeniach: całkowita kwota pożyczki 1 000 zł, stała roczna stopa oprocentowania RSO 18,5%, całkowity koszt 123,42 zł, w tym Prowizja 108,21 zł i odsetki kapitałowe 15,21 zł, a całkowita kwota do spłaty: 1 123,42 zł.\r\nPożyczkodawcy udzielają również pożyczek na warunkach Promocyjnych, w tym pożyczek darmowych, zgodnie z warunkami ustalanymi w Regulaminach Promocji. Promocja obowiązuje pod warunkiem terminowej spłaty pożyczki.\r\nPożyczkodawcą jest PIXO Sp. z o. o. lub LTU Finance Sp. z o. o. Szczegóły na smartpozyczka.pl\r\n\r\nUżywanie brandu Smart Pożyczka w reklamie kontekstowej jest zabronione! Lista słów wykluczających: negative keywords.', NULL, 'https://smartpozyczka.pl/', 'https://zmgig.com/g/c4mjc9g5sj52e070baaf7188e7efa6/', NULL, 'api', '2024-10-23 06:08:13', '2025-01-26 23:00:04', NULL, '37846bc6-710b-4fa1-bbe9-a8d4d0cb5e04', NULL),
