29e816\\\",\\\"643459ce-2619-4819-8a3d-b319aab69d27\\\",\\\"2c50b44b-cddd-4685-8db7-6511bde6cd38\\\",\\\"81864390-a660-477c-82f8-89b3509b7df7\\\",\\\"965a312f-f3f4-424c-af32-632860fba509\\\",\\\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\\\",\\\"6e704421-6015-49fd-ba15-f946556e6e62\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\\\",\\\"675670ac-6c51-45cb-bb40-1b16849e9d98\\\",\\\"dad9da87-890f-427f-9d9b-aa928841ce09\\\",\\\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\\\",\\\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\\\",\\\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\\\",\\\"35224500-7f53-44ce-a774-d5e2299b9f95\\\",\\\"c88534a9-07a1-4153-b2d3-7c784897d752\\\",\\\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\\\",\\\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\\\",\\\"901c1214-e315-4269-b691-e7e23124bb5f\\\",\\\"539a1d2f-fc6e-4082-844a-cdbe6517efed\\\",\\\"6857ddf2-e55c-4640-b194-204950ab2ef8\\\",\\\"b3c43963-4397-414e-ad68-19c161924ef1\\\",\\\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\"]\"', NULL, NULL, 'Blackview is a thriving technology brand that originally specialized in rugged outdoor phones to support rugged lifestyles and survive tough and challenging environments. After 8 years of development, the product category has taken in mainstream phones, smartwatches, earphones, tablets, and laptop.\r\n\r\nBlackview has an 8,500 square-meter factory based in China. With high emphasis on quality and experience, Blackview imposes strict examination on each procedure from design to production. All Blackview products are subject to strict standards and high-quality testing processes to ensure that every user has a great user experience.\r\n\r\nWith the annual sales volume reaching a steady growth of at least 20% in recent years, Blackview\'s customers are all over 80 countries and regions including Russia, Spain, Germany, Czech Republic, Ukraine, France, Italy, Turkey, Algeria, Colombia, South Africa, etc. Blackview has more than 100 authorized agents in over 80 countries and regions. Blackview products are available on various leading e-commerce platforms including Amazon, eBay, AliExpress, Cdiscount, as well as the official Blackview website.', NULL, 'https://store.blackview.hk/', 'https://ypetp.com/g/e3s1raesi252e070baafb0f6ed77fa/', NULL, 'api', '2024-10-23 06:08:13', '2025-01-26 22:50:03', NULL, '21c6f318-1d4e-4cfd-bdec-b088ce364876', NULL),
('d5fde1c6-b1ab-4733-afe9-c5ebae79352e', NULL, 20065, 63654829, NULL, 'DiscoverCars WW', 'USD', '92', NULL, '18', NULL, NULL, 'Admitad', 'logos/discovercarsww.png', 'https://cdn.admitad-connect.com/campaign/images/2020/11/30/20065-6703f84905227d30.png', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '1.93', '193%', '365', 1, 0, 0, 0, 1, 0, NULL, '[]', '[\"87896e59-b1bd-4fb2-aabe-fef329bd307d\",\"8e3c5117-58f2-4198-bbad-6af9734689cd\"]', '[\"00\"]', NULL, '[\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"256c1471-c8aa-495f-8798-3c059ec9b2cc\",\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\"]', '[\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"42c36461-beca-4c52-9570-375bb129e816\",\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\"]', NULL, NULL, 'Партнерская программа DiscoverCars\r\n\r\nОбращаем ваше внимание, что на данный момент на стороне Адмитад техническая возможность маркировки рекламы и передачи данных в ОРД в оффере отсутствует.\r\n\r\nDiscovercars.com - это отмеченный наградами сайт сравнения проката автомобилей (World Travel Awards, Financial Times 1000, Inc. 5000). Клиенты могут найти, сравнить и арендовать автомобиль по всему миру. У нас более 1 миллиона пользователей в разгар сезона, очень высокий рейтинг клиентов на TrustPilot, и мы уже сотрудничаем с некоторыми из лучших веб-мастеров в сфере путешествий. Не упустите свой шанс и начните зарабатывать вместе с нами сегодня!\r\n\r\nВАЖНО:\r\nКонтекстная реклама напрямую на сайт рекламодателя без использования сайта-прокладки строго запрещена. За нарушение данного условия партнер-нарушитель будет отключен от программы с отклонением выплат по лидам. \r\n\r\nФинальные суммы вознаграждения рассчитываются при сверке.\r\nПри использовании полного покрытия после аварий/царапин/вмятин на машине прокатчика по вине пользователя, вознаграждение по заказу будет равно нулю.\r\n\r\nСколько можно заработать?\r\nВеб-сайты с ежемесячным трафиком менее 10 000 могут рассчитывать на 25 бронирований в месяц и прибыль в размере $700 долларов США.\r\nВеб-сайты с 10 001 - 50 000 ежемесячным трафиком могут рассчитывать на 70 бронирований в месяц и прибыль в размере $2,000 долларов США.\r\nВеб-сайты с более чем 50 001 ежемесячным трафиком могут рассчитывать на более 100 бронирований в месяц и доход в размере $3,000 долларов США.\r\n\r\nС кем мы работаем?\r\nБлоги путешествий, туристические онлайн-агентства, сайты размещения, мобильные приложения, туристические компании, аэропорты, авиалинии.\r\n\r\nКомиссия:\r\n54% комиссии с каждого бронирования аренды автомобиля и дополнительно 23% комиссии с каждого дополнительного продукта бронирования аренды автомобиля FullCoverage (вид страхования продукта). Все комиссии выплачиваются из заработанных комиссионных DiscoverCars.com.\r\nФайлы cookie: 365 дней.\r\n\r\nПример вашей комиссии:\r\nСредняя 7-дневная аренда авто на Тенерифе: 54% от бронирования 16,66 EUR + 23% от 44,52 EUR. Полное покрытие = 8,99 + 10,24 = 19,23 EUR - Ваша комиссия\r\n\r\nЧто изменилось из-за COVID-19\r\nПандемия, несомненно, сильно ударила по индустрии туризма, что привело к многочисленным отменам и значительному снижению количества бронирований. В DiscoverCars.com мы следим за текущей ситуацией и приспосабливаемся к обстоятельствам, будучи честными как с нашими клиентами, так и с нашими партнерами. Несмотря на неопределенность ситуации, мы остаемся финансово стабильными и надежными, особенно в том, что касается платежей. Покупатели стали делать заказы в последнюю минуту, а не планировать поездки заранее. Наши самые продаваемые направления часто менялись из-за постоянно меняющейся ситуации с ограничениями.\r\n\r\nКак долго мне придется ждать, чтобы получить деньги?\r\nМы платим нашим партнерам через 60 дней после сдачи в аренду. Это стандарт в отрасли.\r\n\r\nАтрибуция продаж\r\nВы получаете комиссионные с каждой покупки, которую совершают пользователи, как на настольной, так и на мобильной версиях сайта.\r\n\r\nПроцесс подтверждения\r\nСтатус бронирования обновляется через два дня после возврата автомобиля в пункт проката. Вы получаете комиссию только в том случае, если клиент физически появляется, чтобы забрать автомобиль и воспользоваться услугой.\r\n\r\nПреимущества присоединения к партнерской программе DiscoverCars:\r\n\r\n\r\n	У нас одни из самых высоких комиссионных и самый продолжительный срок\r\n	хранения файлов cookie в отрасли.\r\n	Конкурентоспособные цены в более чем 10 000 точек по всему миру.\r\n	Сайт доступен на 17 языках.\r\n	Высокая степень удовлетворенности клиентов: 4,4 из 5 в TrustPilot, 4,3 из 5 в\r\n	Google, 4,2 в Review Center.\r\n\r\n\r\nНаграды (cписок кликабелен):\r\n\r\n\r\n	World Travel Awards\r\n	Magellan Award\r\n	Travel and Hospital Award\r\n	Financial Times Top1000 - 2020\r\n	Trustpilot Top 10\r\n	Similarweb Top 50\r\n	Uzrakota Global Travel Award\r\n	Financial Times Top 1000 - 2021\r\n\r\n\r\nКто некоторые из наших партнеров (кликабельно):\r\n\r\nБлогеры-путешественники: \r\n\r\n\r\n	Annaeverywhere\r\n	Expertvagabond\r\n	Inafarawayland\r\n	Wildjunket\r\n	Alexzimin\r\n	Ourescapeclause\r\n\r\n\r\nАвиалинии: \r\n\r\n\r\n	Aircentury\r\n\r\n\r\nАэропорты: \r\n\r\n\r\n	Liepaja-airport\r\n\r\n\r\nОнлайн-туристические агентства:\r\n\r\n\r\n	Svyaznoy\r\n	Carwix\r\n\r\n\r\nПрисоединяйтесь к партнерской программе DiscoverCars WW!', NULL, 'https://www.discovercars.com', 'https://naiawork.com/g/wqjhitsyjq52e070baaf5ea594bb46/', NULL, 'api', '2024-10-23 06:08:13', '2024-10-29 17:30:02', NULL, NULL, NULL);
