\\"539a1d2f-fc6e-4082-844a-cdbe6517efed\\\",\\\"6857ddf2-e55c-4640-b194-204950ab2ef8\\\",\\\"b3c43963-4397-414e-ad68-19c161924ef1\\\"]\"', NULL, NULL, 'Информируем вас об изменениях в нумерации заказов в партнерской программе Alibaba WW. C 27.11.2020 номер заказа в статистике Admitad будет совпадать с номером заказа в личном кабинете Alibaba.\r\nНапример:\r\nСтарый номер заказа - 62703359001042670_623667726107_71P9.\r\nНовый номер заказа- 62703359001042670.\r\nКроме того, с 27.11.2020 отменяется разделение заказа на несколько подзаказов. Теперь состав заказа в Admitad соответствует составу заказа в Alibaba.\r\nИзменения не касаются заказов, которые уже были зарегистрированы в системе.\r\n\r\nИнструмент “Потерянные заказы” отключен в партнерской программе Alibaba WW с 20 июля 2020 года.\r\n\r\nВ связи с повышенным спросом на медицинские изделия из-за распространения COVID-19, с 23 марта 2020 года Alibaba WW временно исключает медицинские маски для лица и медицинские расходные материалы из партнерской программы.\r\n\r\nЗаказы следующих категорий, которые созданы после 23 марта 2020 года, не будут оплачиваться рекламодателем:\r\n\r\n\r\n	Безопасность и защита> Средства индивидуальной защиты > Маски и респираторы.\r\n	Для здоровья и медицины> Медицинские расходные материалы.\r\n\r\n\r\nСайт Alibaba.com был запущен в 1999 году и является крупнейшей в мире онлайн-платформой для В2В-торговли. На площадке представлены десятки миллионов товаров, включая электронику, одежду, косметику, бытовую химию и другие товары. На Alibaba покупают жители более, чем 200 стран, ценность одного клиента может достигать $200.\r\n\r\n\r\n\r\nМиссия Alibaba \r\n\r\nМиссия Alibaba.com - сделать ведение бизнеса доступным для всех. Alibaba предоставляет поставщикам возможность показать свои товары покупателям со всего мира, а покупателям возможность быстро и эффективно найти интересующие их товары и поставщиков. \r\n\r\n\r\n\r\nНа Alibaba.com представлены сотни миллионов товаров из более 40 различных категорий, включая электронику, оборудование и одежду. \r\n\r\nПокупатели Alibaba живут в 200 странах мира и обмениваются сотнями тысяч сообщений с поставщиками на платформе каждый день.\r\n\r\n\r\n\r\nОбратите внимаение, что вы можете создавать диплинки только на товары. Диплинки, ведущие на категории товаров и распродажи, будут вести на главную страницу сайта. \r\n\r\nВ контекстной рекламе запрещено использовать слово Alibaba и другие его вариации, в комбинациях с другими словосочетаниями, в том числе с некорректным написание слова. Например Allibaba, Alebaba и др. Вебмастера, нарушающие правила, будут незамедлительно отключены от партнерской программы без возможности выплаты вознаграждений за заказы.  Ознакомиться со списком примеров.\r\n\r\nПравила, по которым заказы могут быть отклонены как спам можно найти ТУТ.', NULL, 'https://www.alibaba.com/', 'https://rzekl.com/g/pm1aev55cl52e070baaf219aa26f6f/', NULL, 'api', '2024-10-23 06:08:13', '2025-01-26 23:00:07', NULL, '0f778cea-a279-447d-85f4-f99e7c0efd80', NULL),
