224500-7f53-44ce-a774-d5e2299b9f95\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"42c36461-beca-4c52-9570-375bb129e816\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"8135684a-827b-4322-8872-d0812cbe4b9c\"]', NULL, NULL, 'The largest international seller of train tickets in Italy.\r\n\r\n\r\n	Italiarail is the expert in seamless train travel within Italy\r\n	Guaranteed lowest prices\r\n	24-hour customer support\r\n	ItaliaRail.com offers an exclusive luggage service as well as discounted sightseeing and hotels\r\n	Multi-currency payment options\r\n	Instant electronic tickets\r\n	Special group rates for students and educators that are up to 80% off the regular price\r\n\r\n\r\nIt\'s possible to buy tickets around Italy from €9.90/€19.90/€29.90 from www.italiarail.com who connect directly to the Trenitalia ticketing system.Customers can also buy in €, £ or $. \r\n\r\nBooking opens 180 days ahead for most long-distance trains in Italy, except when the mid-June & mid-December timetable changes intervene.  All international credit cards accepted, and customer either just quote their booking reference on board the train. www.italiarail.com is easier to use, all in plain English with English-language place names - and it can be cheaper then Trenitalia.com if there are 2 or more of you.  \r\n\r\nAfter recent improvements it\'s a better system than Trenitalia in many ways:  It shows a whole day\'s trains in the search results not just an hour or two, it can book up to 20 people at a time, Trenitalia only books up to 5 people, it highlights the cheapest trains and trains where 1st class is cheaper than 2nd as a free upgrade.\r\n\r\nAlthough www.italiarail.com accesses exactly the same prices as Trenitalia, it can be cheaper for 2 or more people travelling together because it can combine the last remaining tickets at a cheaper price level with tickets at a higher level within the same booking.  Trenitalia can\'t, so will ignore any remaining tickets at the cheaper price level if there aren\'t enough for all the passengers travelling. \r\n\r\nOnline sales include train tickets.\r\n\r\n_ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ __ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _ _\r\n\r\nIl più grande venditore dei biglietti in Italia.\r\n\r\n\r\n	Italiarail è un esperto in viaggi in Italia;\r\n	Garanzia dei prezzi più bassi;\r\n	Assistenza per i consumatori 24-ore;\r\n	ItaliaRail.com offre un esclusivo servizio bagagli, visite turistiche scontate e albergi;\r\n	Opzioni di pagamento multi-valuta;\r\n	Biglietti elettronici imediati;\r\n	Tariffe speciale meno 80% dal prezzo standart per gli studenti e educatori.\r\n\r\n\r\nÈ possibile comprare biglietti in giro per Italia dal €9.90/€19.90/€29.90 sul www.italiarail.com che è conetto direttamente con sistema dei biglietti Trenitalia.\r\n\r\nConsumatori possono pagare in €, £ or $. La prenotazione apre 180 giorni in aticipo per la maggior parte dei treni a lunga distanza in Italia, tranne quando intervengono i cambiamenti di orario di metà giugno e metà dicembre.\r\n\r\nSono accettate tutte le carte di credito internazionali.\r\n\r\nPuò essere più economico di Trenitalia.com a 2 volte.\r\n\r\nDopo miglioramenti recenti è migliore di Trenitalia in molti modi: in risultati di ricerca dimostra i treni non solo per una o due ore, ma per tutto il giorno.\r\n\r\nC’è possibilità di fare prenotazione per 20 persone ad una volta,Trenitalia fa prenotazioni solo per 5 persone ad una volta.\r\n\r\nDimostra i prezzi più bassi per i treni. Anche dimostra dove il prezzo per 1 classse è più basso di 2 classe.\r\n\r\nAnche www.italiarail.com da acesso con ai prezzi gli stessi come in Trenitalia.\r\n\r\nIl prezzo può essere più economico per 2 o di più persone che viaggiano insieme perché si può combinare gli ultimi biglietti rimasti ad un livello di prezzo più basso con biglietti di livello superiore all\'interno della stessa prenotazione.', NULL, 'https://www.italiarail.com/', 'https://ujhjj.com/g/ca326rdm5v52e070baafef1cea9751/', NULL, 'api', '2024-10-23 06:08:13', '2024-10-29 17:30:02', NULL, NULL, NULL),
