('50da9186-4202-4ba6-9492-51ad003fcb04', NULL, 22111, 53004987, NULL, 'DM Микрокредит (Деньги Click) CPS KZ', 'KZT', '27', NULL, '5770', NULL, NULL, 'Admitad', 'logos/dmclickcpskz.svg', 'https://cdn.admitad-connect.com/campaign/images/2023/12/12/22111-9414bcc36ed832dd.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '5680', '568000KZT', '30', 0, 0, 0, 0, 1, 0, NULL, '[\"Kazakhstan\"]', '[\"b55c8bae-fe47-419d-ad39-602767326bd3\",\"d1639324-9fde-494a-b902-6a3e4c0edd0d\",\"855297dd-f656-4b44-8b0b-ef800d27027d\",\"0d6a7c0b-bffe-483c-9948-2e058d77a199\"]', '[\"KZ\"]', NULL, '[\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\"]', '[\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"42c36461-beca-4c52-9570-375bb129e816\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"539a1d2f-fc6e-4082-844a-cdbe6517efed\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\",\"901c1214-e315-4269-b691-e7e23124bb5f\",\"8135684a-827b-4322-8872-d0812cbe4b9c\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"965a312f-f3f4-424c-af32-632860fba509\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\"]', NULL, NULL, 'DM Микрокредит (Деньги Click) - это инновационный сервис, который предоставляет онлайн микрокредиты по всей Республике Казахстан. Его сеть охватывает 17 областей и включает более 180 точек продаж. В стремлении сделать финансовые услуги более доступными, компания планирует расширять своё присутствие на географической карте.\r\n\r\nПрофиль целевого клиента в этом сегменте - мужчина в возрасте 25-34 лет, имеющий кредитные карты или небольшой потребительским кредитом, со средним доходом. Этот портрет можно дополнительно разделить на следующие сегменты:\r\n\r\n\r\n	Ипотечник: увлечен ремонтом, строительством и интернет-покупками мебели.\r\n	Автовладелец среднего класса, чьи авто в основном - подержанные иномарки. Интересы - автомобили, запчасти, шины, масла и техническое обслуживание.\r\n	Игроки, увлеченные форексом, криптовалютами, фьючерсами и инвестированием.\r\n\r\n\r\nОсновное описание:\r\n\r\n\r\n	Сумма микрокредита: от 10 000 до 300 000 тг\r\n	Срок микрокредита: от 1 до 3 месяцев\r\n	Ставка: 0,10% - (ГЭСВ до 46%)\r\n\r\n\r\nТребование к заёмщику:\r\n\r\n\r\n	Гражданство Республика Казахстан\r\n	Возраст от 18 до 75 лет\r\n	Наличие личного банковского счета\r\n	Наличие регулярного ежемесячного дохода\r\n	Наличие личной электронной почты\r\n	Наличие активного номера мобильного телефона\r\n	Наличие положительной кредитной истории\r\n\r\n\r\nСпособы получения:\r\n\r\n\r\n	Банковская карта\r\n	В офисе компании\r\n	Терминал\r\n	Мобильное приложение\r\n\r\n\r\nСпособы погашения:\r\n\r\n\r\n	В любом отделении “Деньги маркет”\r\n	Банковской картой в личном кабинете\r\n	С помощью терминалов или кошелька «Qiwi»\r\n	С помощью терминалов или кошелька Касса 24\r\n	С помощью терминалов или кошелька CyberPlat\r\n	Переводом на расчетный счет\r\n\r\n\r\nЛицензия \r\nhttps://p-api.dengiclick.kz/upload/documents/лицензия%20МФО%20ЛФТех_compressed.pdf\r\n\r\nС 20.10.2020 в связи с законом о рекламе Республики Казахстан должны быть внесены изменения во все рекламные материалы (баннеры, тексты, сайты и пр.):\r\n\r\n\r\n	1. Заменить \"0%\" (запрещен) на от \"0,99%\"\r\n	2. Слова \"бесплатно\" (запрещено) можно заменить на фразу \"без переплат\"\r\n	3. Заменить слова \"займ\" и \"кредит\" (запрещены) на слово \"микрокредит\"\r\n\r\n\r\nНа рекламных материалах (изображениях) - значение ГЭСВ в цифровом выражении должна быть одинаковой по стилю оформления шрифтов с другими ставками вознаграждения (размер, курсив, полужирный, выделение цветом и тд). Чтобы не был мелким шрифтом размещен где то в углу. Простыми словами, шрифт ГЭСВ должен быть = размеру ставки\r\n\r\nМинус слова для контекстной рекламы по ссылке.\r\n\r\n-------------------\r\n\r\nДля оперативного информирования об изменениях и новостях, подписывайтесь на телеграм-канал Адмитад Казахстан!', NULL, 'https://dengiclick.kz/', 'https://yynbx.com/g/q4q70ud6rs52e070baaf89b4f4a271/', NULL, 'api', '2024-10-23 06:08:13', '2024-10-29 17:30:02', NULL, NULL, NULL),
