дети; \r\n	недвижимость; \r\n	спорт.\r\n\r\n\r\nВозраст: \r\n25 -34 года – 61,8%\r\n18 -24 года – 17,6%\r\n35 -44 года – 13%\r\nПол:\r\nЖенщины – 55%\r\nМужчины – 45%\r\n \r\n\r\n\r\nПрисоединяйтесь к партнерской программе прямо сейчас!', NULL, 'https://delivio.by/', 'https://xcdus.com/g/jcreshw9se52e070baaf1088f79e59/', NULL, 'api', '2024-10-23 06:08:13', '2025-01-26 23:00:08', NULL, '908d6fa6-7542-4c54-84e3-bf2a64bd2de1', NULL),
