в день\r\n	Срок на 25 дней - 1,10% в день\r\n	Срок на 30 дней - 1% в день\r\n\r\n\r\n\r\n	Есть возможность досрочного погашения и продления микрокредита\r\n\r\n\r\nЦелевая аудитория:\r\n\r\n\r\n	Гражданство Казахстана\r\n	Возраст от 19 до 70 лет\r\n	Наличие номера счета (IBAN) банковской карты или текущего счета (для перечисления кредитных средств)\r\n\r\n\r\nПреимущества:\r\n\r\n\r\n	Микрокредит можно оформить, не выходя из дома или работы, прямо на номер счета (IBAN) карты или номер текущего счета (IBAN) в банке;\r\n	Прозрачные условия получения микрокредита;\r\n	Микрокредит быстро, без залога, без длительных процедур оформления и проверок;\r\n	Выдаем микрокредиты по всему Казахстану;\r\n	Компания гарантирует конфиденциальность клиента  и безопасность данных персонального характера.\r\n\r\n\r\nКак получить: \r\n\r\n\r\n	Оформите заявку онлайн - выберите сумму и срок с помощью калькулятора, заполните анкету.\r\n	Дождитесь решения - через sms - в течении 7 минут.\r\n	Получите деньги на карту или IBAN счёт.\r\n\r\n\r\nСпособы погашения:\r\n\r\n\r\n	В терминале QIWI\r\n	В личном кабинете\r\n	Банковским переводом по нашим реквизитам\r\n\r\n\r\nСписок минус-слов по ссылке.\r\n\r\nСправка о зарегистрованном юр. лице по ссылке.\r\n\r\n \r\n\r\nС уважением,\r\n\r\nпартнерская программа CreditPlus (CPS) KZ\r\n\r\n----------\r\n\r\nДля оперативного информирования об изменениях и новостях, подписывайтесь на телеграм-канал Адмитад Казахстан!', NULL, 'https://creditplus.kz/', 'https://heqgr.com/g/6yu8esrq6952e070baaf90398ae051/', NULL, 'api', '2024-10-23 06:08:13', '2025-01-26 23:00:08', NULL, '5f2affa4-087e-407d-b348-496a8a00a685', NULL),
