tienne Aigner was born in Hungary in 1904. More than half a century ago he presented his first handbag collection in New York – and caused a major sensation. In 1950 people were so excited about Aigner\'s exclusive leather creations especially the invention of the \"steamer trunk\" for the legendary transatlantic liners or the Orient Express. A few years later Etienne Aigner met Heiner H. Rankl, a businessman with a keen feel for the future and a strong sense of tradition – Therefore, the brand AIGNER was born in 1965, in Munich. AIGNER infused its products with a rural, countrystyle feel. There was always a sense of the racecourse, a feeling of being by the fireside. A phenomenon that can still be felt till present.', NULL, 'https://aignermunich.ae/en_ae', 'https://naiawork.com/g/sslnuer7d852e070baafe646b60cde/', NULL, 'api', '2024-10-23 06:08:13', '2024-10-29 17:30:02', NULL, NULL, NULL),
