в).\r\n\r\n\r\nСправка о зарегистрованном юр. лице по ссылке. \r\n\r\n--------\r\n\r\nДля оперативного информирования об изменениях и новостях, подписывайтесь на телеграм-канал Адмитад Казахстан!', NULL, 'https://credit365.kz/', 'https://rzekl.com/g/gmspo17b9752e070baafc9987c177b/', NULL, 'api', '2024-10-23 06:08:14', '2024-10-29 17:30:02', NULL, NULL, NULL),
