Pal a platbu předem bankovním převodem na účet. Zákaznický servis je našim zákazníkům dostupný Po-Pá 09:00-18:00.\r\n\r\nSpolu s dalšími 25 zooplus obchody, jako např. zooplus.de, zooplus.fr, zooplus.nl, atd., patříme k chovatelským potřebám číslo 1 v Evropě!\r\n\r\nVýhody, které získáte spoluprací se zoohit.cz\r\n\r\n\r\n	Odměna pro Vás: až 3% provize z kupní ceny (bez DPH)!\r\n	Velmi dobrá míra konverze/Conversion Rate\r\n	Vysoká hodnota průměrné objednávky (1500 Kč)\r\n	Nízký počet zrušených objednávek/Cancelation Rate (2-6%)\r\n	Cookie - 30 dní\r\n', NULL, 'https://www.zoohit.cz/', 'https://rcpsj.com/g/dnfdwctwlt52e070baafe88da1467f/', NULL, 'api', '2024-10-23 06:08:14', '2025-01-26 23:00:06', NULL, '750b5b70-ecb0-43e3-b2e8-23f2940ac6f0', NULL),
