\r\nDubaiStore\r\n\r\nDubaiStore, part of Digital Economy Solutions (DES), is the latest online marketplace in the United Arab Emirates:\r\n\r\nMulti-category marketplace platform for SME’s and etraders.\r\n\r\n\r\n	Electronics\r\n	Grocery\r\n	Heath & beauty\r\n	Fashion\r\n	Home\r\n	Baby & Toys\r\n	Books\r\n	Sports \r\n	Music \r\n	Stationery\r\n	\r\n		UAE licensed business only (True to our slogan “Shop with Trust”)\r\n		Full solutions for merchants\r\n		Click & Shop online: www.dubaistore.com\r\n	\r\n	\r\n\r\n\r\nDubaiStore is a true ecommerce marketplace dedicated to promote businesses without competing with them. Affiliated with Dubai’s Department of Economic Development, DubaiStore aims to enable ecommerce for SMEs, Enterprises, and licensed home businesses (E-Traders).\r\n\r\nTo be a seller on DubaiStore, merchants must have a trade license. Combined with DubaiStore’s affiliation with the Consumer Protection division, this will create a healthy trusted environment for both merchants and customers.\r\n\r\nBusinesses onboarded to DubaiStore can incorporate their brand identity around their product listings and will have their own microsite store within the platform with customizable content, in addition to key functionalities that extend their own business processes and policies, thus giving more flexibility to customers not available in other regional marketplaces.\r\n\r\nDubaiStore is integrated with trusted partners such as Zajel and QuikUp for fast delivery as well noqodi for online payments.\r\n\r\n \r\n\r\nOur advantages for publishers include:\r\n\r\n\r\n	More than 800 sellers on the platform and growing rapidly with a product catalogue over 350,000 lines\r\n	Trusted UAE commercially licensed only sellers on platform\r\n	All product supplied and delivered within UAE at competitive prices\r\n	Competitive commission rates in UAE market\r\n	Regular Sale and Flash Sale events each month supporting higher conversion rates\r\n	Frequent online voucher codes\r\n\r\n\r\n \r\n\r\nDubaiStore audience insights:\r\n\r\nAge of customers:\r\n\r\n\r\n	68% aged 25 to 44 years old\r\n\r\n\r\nGender:\r\n\r\n\r\n	Male:    57%\r\n	Female:     43%\r\n\r\n\r\nLanguage:         \r\n\r\n\r\n	English:  98%\r\n	Arabic:    2%\r\n\r\n\r\nDevice:\r\n\r\n\r\n	Desktop                           -             25%\r\n	Responsive Mobile        -             65%\r\n	Tablet                               -             5%\r\n	Native App                      -             5% (60/40 split in favor of Android)\r\n\r\n\r\n\r\n\r\n \r\n\r\n ', NULL, 'https://www.dubaistore.com/', 'https://ad.admitad.com/g/hvwnmgq26h52e070baaf74025c6e6e/', NULL, 'api', '2024-10-23 06:08:14', '2024-10-29 17:30:02', NULL, NULL, NULL),
