('ac5bc629-59b8-46a0-8496-e868c0ae3223', NULL, 27658, 56429083, NULL, 'ePojisteni CZ CPL', 'CZK', '39', NULL, '699', NULL, NULL, 'Admitad', 'logos/epojisteniczcpl.svg', 'https://cdn.admitad-connect.com/campaign/images/2024/6/21/27658-7ec2aa0dad59e4c9.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '455', '1050%700045500CZK', '30', 1, 0, 0, 0, 1, 0, NULL, '[\"Czech Republic\"]', '\"[\\\"b55c8bae-fe47-419d-ad39-602767326bd3\\\",\\\"56cea0bc-02a0-4a25-91a6-e7f3b9f9b977\\\"]\"', '\"[\\\"CZ\\\"]\"', NULL, '[\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\"]', '\"[\\\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\\\",\\\"2c50b44b-cddd-4685-8db7-6511bde6cd38\\\",\\\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\\\",\\\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\\\",\\\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\\\",\\\"35224500-7f53-44ce-a774-d5e2299b9f95\\\",\\\"c88534a9-07a1-4153-b2d3-7c784897d752\\\",\\\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\\\",\\\"42c36461-beca-4c52-9570-375bb129e816\\\",\\\"643459ce-2619-4819-8a3d-b319aab69d27\\\",\\\"965a312f-f3f4-424c-af32-632860fba509\\\",\\\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\\\",\\\"6e704421-6015-49fd-ba15-f946556e6e62\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\\\",\\\"675670ac-6c51-45cb-bb40-1b16849e9d98\\\",\\\"dad9da87-890f-427f-9d9b-aa928841ce09\\\",\\\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\\\",\\\"901c1214-e315-4269-b691-e7e23124bb5f\\\",\\\"539a1d2f-fc6e-4082-844a-cdbe6517efed\\\",\\\"6857ddf2-e55c-4640-b194-204950ab2ef8\\\",\\\"b3c43963-4397-414e-ad68-19c161924ef1\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\"]\"', NULL, NULL, 'ePojištění is the largest and most important insurance comparator on the Czech Internet. It concludes more than 1,000 auto insurance contracts per week. They are known in the media and their prices are really the lowest. They cooperate with all insurance companies on the Czech market.\r\n\r\nImplementation of new measurement for eInsurance campaigns!\r\n\r\nAll tracking links are redirected to the main ePojištění.cz campaign (formerly Povinné ručení ePojištění.cz), to which we have added individual URLs and all creative elements from other ePojištění campaigns.\r\n\r\nTherefore, there will now be only one campaign called ePojištění.cz in the eSpolupráce menu, where you will be able to precisely target other ePojištění campaigns via individual URLs. Therefore, if you need to target exactly one of the ePojštění campaigns (for example, property insurance), you need to generate a new tracking link with the appropriate URL so that you can link exactly to the required landing page (or form) of the ePojštění campaign. By generating a new link, you will also speed up page loading (no redirection will take place).\r\n\r\nIt is also important to say that XSELL also works between individual campaigns.\r\n\r\nRunaways:\r\nAs for follow-ups, automatic measurement is no longer possible after stopping the original campaigns. Therefore, all overruns will be finished immediately after sending reports from the advertiser!\r\n\r\nConversion measurement:\r\nThe new measurement is set up so that Postback is called on every request. However, the commission model for this campaign is set as CPL (pay per lead). For this reason, duplicate conversions are created, which are immediately rejected because they are the same leads. However, if multiple inquiries arise from one (same) lead, which subsequently convert into closed and paid contracts, you are entitled to a commission for each of these conversions according to the appropriate reward (depending on the type of campaign).\r\n\r\nNow all conversions are loaded into the new ePojištění.cz campaign (ID:2). In order to distinguish individual eInsurance campaigns in the conversion report, you need to check the GOAL box in the REPORT OPTIONS menu directly when generating reports in your account.\r\n\r\n\r\nATTENTION:\r\nIt is not possible to set redirection for IFRAME forms! It is therefore necessary to generate them again and implement them on your websites from the new ePojištění.cz campaign (ID:2). Loading old IFRAMS won\'t work!\r\n\r\n\r\nExample:\r\n--- \"Affiliate partner brings in a lead that creates a demand for liability insurance. So the affiliate gets paid for the lead. Subsequently, this same contact (lead) generates another demand for accident insurance, travel insurance and property insurance. This causes that for liability this affiliate partner no longer gets paid for the lead, but in the case of a negotiated and paid contract for the other requests (accident insurance, property insurance and travel insurance), the commission is normally calculated for the partner according to the conditions of the given campaign.\" ---\r\n\r\nNo bidding on keywords and titles listed in THIS DOCUMENT! Violation of this prohibition may lead to blocking in ePojisteni.cz campaigns.\r\n\r\nCommission model: Payment for a valid lead - callable and interested in POV. The conversion appears in the system within 10 minutes. \r\n\r\nAttention! Only quality leads get paid! Advertiser reserves the right to retroactively reject invalid leads.\r\nWhat is quality further in the rules:\r\nThe minimum sales conversion threshold should be between 12% and 30%. If the conversion is below the minimum threshold, such registrations will not be paid.\r\n\r\nCZ\r\n\r\nePojištění je největším a nejvýznamnějším srovnávačem pojištění na českém internetu. Týdně uzavírá více jak 1000 smluv ohledně pojištění vozidel. Jsou mediálně známí a jejich ceny jsou skutečně nejnižší. Spolupracují se všemi pojišťovnami na českém trhu.\r\n\r\nImplementace nového měření u kampaní ePojištění!\r\n\r\nVeškeré tracking linky jsou přesměrovány na hlavní kampaň ePojištění.cz (dříve Povinné ručení ePojištění.cz), do které jsme přidali jednotlivé URLs a všechny kreativní prvky z ostatních kampaní ePojištění.\r\n\r\nNově tedy bude v nabídce eSpolupráce pouze jedna kampaň s názvem ePojištění.cz, kde budete moci přesně cílit přes jednotlivé URLs i na ostatní kampaně ePojištění. Pokud tedy potřebujete zacílit přesně na jednu z kampaní ePojištění (například pojištění majetku), je třeba si vygenerovat nový tracking link s patřičnou URL, abyste mohli přesně odkazovat na požadovanou landing page (nebo formulář) kampaně ePojištění majetek. Vygenerováním nového linku tak navíc urychlíte načítání stránky (nebude probíhat přesměrování).\r\n\r\nDůležité je také říct, že zároveň funguje XSELL mezi jednotlivými kampaněmi.\r\n\r\nDoběhy:\r\nCo se týká doběhů, tak automatické měření již po zastavení původních kampaní není možné. Proto veškeré doběhy budou dohrávány vzápětí po zaslání reportů od inzerenta!\r\n\r\nMěření konverzí:\r\nNové měření je nastaveno tak, že se Postback volá při každé poptávce. Provizní model u této kampaně je však nastaven jako CPL (platba za lead). Z toho důvodu se vytváří duplicitní konverze, které jsou ihned zamítány, jelikož jde o stejné leady. Pokud ale z jednoho (stejného) leadu vznikne vícero poptávek, které následně konvertují do uzavřených a zaplacených smluv, vzniká Vám nárok na provizi za každou z těchto konverzí podle patřičné odměny (dle typu kampaně).\r\n\r\nNyní se tedy všechny konverze načítají do nové kampaně ePojištění.cz (ID:2). Abyste v reportu konverzí dokázali odlišit jednotlivé kampaně ePojištění, je třeba zaškrtnout políčko GOAL v nabídce REPORT OPTIONS přímo při generování reportů ve Vašem účtu.\r\n \r\n\r\nPOZOR:\r\nU IFRAME formulářů není možné nastavit přesměrování! Je tedy nutné vygenerovat si je znovu a implementovat je na Vaše weby právě z nové kampaně ePojištění.cz (ID:2). Načítání starých IFRAMŮ nebude fungovat!\r\n\r\n\r\nPříklad:\r\n--- \"Affiliate partner přivede lead, který vytvoří poptávku na povinné ručení. Partner tedy dostane platbu za lead. Následně tento stejný kontakt (lead) vytvoří další poptávku na havarijní pojištění, cestovní pojištění a pojištění majetku. To způsobí, že za povinné ručení už tento affiliate partner nedostává zaplaceno za lead, ale v případě sjednané a zaplacené smlouvy u těch ostatních poptávek (havarijní pojištění, pojištění majetku a cestovní pojištění) se partnerovi počítá provize normálně dle podle podmínek dané kampaně.\" ---\r\n\r\n \r\n\r\nZákaz bidování na klíčová slova a názvy uvedené v TOMTO DOKUMENTU! Porušení tohoto zákazu může vést k blokaci v kampaních ePojisteni.cz.\r\n\r\nProvizní model:Platba za validní lead - dovolatelný a se zájmem o POV. Konverze se v systému objevuje do 10 minut.\r\n\r\nPozor! Pouze kvalitní leady podléhají platbě! Inzerent si vyhrazuje právo zpětně zamítnout nevalidní leady.\r\nCo je kvalita dále v pravidlech:\r\nMinimální práh konverze prodeje by měl být od 18 % do 30 %. Pokud je konverze pod minimální hranicí, takové registrace nebudou zaplaceny.', NULL, 'https://www.epojisteni.cz/', 'https://xnmik.com/g/dukhgb1mzh52e070baaf4f71057c1b/', NULL, 'api', '2024-10-23 06:08:14', '2025-01-26 22:50:05', NULL, 'ac5bc629-59b8-46a0-8496-e868c0ae3223', NULL),
('c5a3b822-0c2c-4b35-8b56-87c0dd6c30f5', NULL, 27676, 91298432, NULL, 'Sanatoriums', 'EUR', '60', NULL, '1', NULL, NULL, 'Admitad', 'logos/sanatoriums.jpg', 'https://cdn.admitad-connect.com/campaign/images/2022/2/8/27676-d266269ca85d317f.jpg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '40', '4000%', '30', 1, 0, 0, 0, 1, 0, NULL, '[]', '[\"87896e59-b1bd-4fb2-aabe-fef329bd307d\",\"38689ce9-409b-4dd6-b771-edda90654a00\"]', '[\"00\"]', NULL, '[\"efced686-40b0-446a-8c7b-96a0610e8372\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"256c1471-c8aa-495f-8798-3c059ec9b2cc\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\",\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"81864390-a660-477c-82f8-89b3509b7df7\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\"]', '[\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"8135684a-827b-4322-8872-d0812cbe4b9c\",\"42c36461-beca-4c52-9570-375bb129e816\",\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\",\"901c1214-e315-4269-b691-e7e23124bb5f\",\"539a1d2f-fc6e-4082-844a-cdbe6517efed\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"965a312f-f3f4-424c-af32-632860fba509\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\"]', NULL, NULL, ' \r\n\r\nОбращаем ваше внимание, что на данный момент на стороне Адмитад техническая возможность маркировки рекламы и передачи данных в ОРД в оффере отсутствует. \r\n\r\nОписание\r\n\r\nSanatoriums.com - Крупнейший онлайн-портал по выбору и бронированию санаториев и спа отелей на лучших лечебных курортах мира. Сервис предоставляет уникальные инструменты поиска профильного курорта и санатория по клиническим показаниям клиента, гибкие и выгодные условия бронирования, а также организацию дополнительных сервисов санаторно курортного отдыха.\r\n\r\nПреимущества сотрудничества с Sanatoriums.com для партнеров\r\n\r\n\r\n	Высокий средний чек бронирования 1500 EUR \r\n	Комиссия RevShare 40%. Средняя комиссия от чека 4.5%\r\n	Топ офферов по заработку доступен по ссылке https://docs.google.com/spreadsheets/d/1Mjfe0boNbM9UGmAa9Q4trSkfXPppGW4WFtK8SPO_RL4/edit#gid=416740998\r\n	сookie - 30 дней;\r\n	Самый узнаваемый бренд в санаторно курортном туризме существующий на рынке с 2013 года\r\n	Разрешено использование видео и фото материалов на ресурсах партнера (без удаления водяного знака)\r\n\r\n\r\nПреимущества сотрудничества с Sanatoriums.com для клиентов\r\n\r\n\r\n	Бронирование с оплатой при заселении и бесплатной отменой\r\n	Моментальное подтверждение брони\r\n	Возможность оплаты картой онлайн\r\n	Поисковик санаториев и курортов по заболеваниям клиента\r\n	Видеоролики о курортах и санаториях\r\n	Сопровождение клиента на всех этапах санаторного отдыха\r\n	Бесплатные консультации врача курортолога\r\n	Дополнительные преимущества в виде бесплатных экскурсий и трансферов\r\n	Самые низкие цены на проживание с лечебным пакетом\r\n	На сайте представлены только лучшие из лучших санаториев\r\n\r\n\r\nГеография клиентов\r\n\r\n\r\n	Россия, Украина, Беларусь, Казахстан, Туркменистан, Молдова, Азербайджан, Армения, Грузия и другие страны СНГ\r\n	Германия\r\n	Другие страны Европейского союза\r\n	Израиль\r\n	Литва, Латвия и Эстония\r\n	США и Канада\r\n\r\n\r\nЯзык клиентов\r\n\r\n\r\n	Русский, украинский, немецкий, английский и другие\r\n\r\n\r\nЦелевая аудитория\r\n\r\n\r\n	Женщины/мужчины старше 55 лет\r\n	Люди преклонного возраста\r\n	Люди с проблемами со здоровьем\r\n\r\n\r\n \r\n\r\nИнформация по процессу генерации дополнительных баннеров вебмастерами:\r\n\r\nДля скачивания баннера необходимо сформировать его URL-адрес, состоящий из 6 частей. В общем виде ссылка на баннер имеет следующий вид: https://prod.affsanatoriums.com/images/banners/v1/{dimension}-{geoId}-{pageType}-{language}.{extension}. Части ссылки разделяются между собой символом “-”. Разбираем по частям:\r\n\r\n1. Статическая часть https://prod.affsanatoriums.com/images/banners/v1/ всегда неизменна.\r\n\r\n2. Далее добавляем в URL нужный вам размер баннера (он же {dimension}) из таблицы, например, 725x90.\r\n\r\n3. Далее из таблицы {geoId} добавляем в URL ID страны или курорта.\r\n\r\n4. Далее в URL добавляем тип баннера из таблицы {pageType}, от которого будет зависеть текст.\r\n\r\n5. Затем из таблицы {language} добавляем язык текста баннера: русский, немецкий, английский или чешский.\r\n\r\n6. Далее через точку добавляете формат изображения из таблицы {extension}: .png или .jpeg.\r\n\r\nПример баннера, который у вас должен получиться: https://prod.affsanatoriums.com/images/banners/v1/725x90-CZE_FL-mainpage-de.jpeg\r\n\r\nРекламодатель платит вознаграждение от полученной собственной партнерской комиссии.\r\n\r\n ', NULL, 'https://www.sanatoriums.com/', 'https://kjuzv.com/g/82hm46o8g452e070baaf790b103c92/', NULL, 'api', '2024-10-23 06:08:14', '2024-10-29 17:30:02', NULL, NULL, NULL),
