sion on every ticket sale.', NULL, 'https://toughmudder.co.uk/', 'https://ad.admitad.com/g/yca240rkex52e070baafdad78ecae7/', NULL, 'api', '2024-10-23 06:08:14', '2025-01-26 23:00:05', NULL, '5cd811cd-f2c5-4ebe-a46a-f665d423eeec', NULL),
