in the Middle East, continuing to be one of the few Middle East-based private airlines to this day.\r\n\r\nJazeera Airways serves to more than 50 destinations operating a reliable fleet of Airbus A320 and A320neo aircraft – all fitted with our signature leather seats and two or three class cabins. In June 2018, Jazeera was the first airline in the Middle East to introduce the A320neo into its fleet.\r\n\r\nJazeera Airways owns and operates its own terminal at Kuwait International Airport – Terminal 5 (T5) ensuring an enhanced passenger experience with dedicated check-in, fast immigration and short transfer distances.\r\n\r\n\r\nJazeera Airways Economy Class offers great value. On board, passengers can watch the complimentary Jazeera Screens in-flight entertainment and purchase from a wide variety of food and drink options from the Jazeera Café menu. Passengers can upgrade their seat selection to either Priority Seats (Rows 4-6) with 31-inch seat pitch which allow priority boarding, Preferred Seats (Rows 7-10) with 31-inch seat pitch or XL/Extra Legroom Seats (Rows 11-12) with 36-inch seat pitch.\r\n\r\nOur website and mobile app provide a simple and direct way to make bookings with all the best fares and Travel Extras. In addition, our partners Booking.com (hotels), Rentalcars.com (cars) and AIG (insurance) provide greats deals for our customers when booking through our website.\r\n\r\nJazeera Airways offers you peace of mind. Our dependable cargo services ship to a number of destinations – you can deliver both your large and small shipments with our trusted agents.\r\n\r\nJazeera Airways is a publicly-traded company and is listed on the Kuwait Stock Exchange. \r\n\r\nJazeera Airways is an IATA-member and keeps to high international standards of safety and security.', NULL, 'https://www.jazeeraairways.com/', 'https://ad.admitad.com/g/t368642v7w52e070baaf9f3b665a76/', NULL, 'api', '2024-10-23 06:08:14', '2024-10-29 17:30:02', NULL, NULL, NULL);
