l destination for luxury fashion at discounted prices in the region.\r\n\r\nThe Deal offers luxury brands at an affordable price point, with year-round discounts between 40-70% on an incredible range of international brands and designer labels including Ralph Lauren, Tods, Michael Kors, Lacoste, Swarovski, Tory Burch, Vilebrequin, Zadig & Voltaire, Moschino, Chloe, Hugo Boss, Givenchy, Cavalli, DSquared, Golden Goose, Jacob Cohen, Versace, Replay, Geox, Max Mara.\r\n\r\nThe continually updated collection spans womenswear, menswear and kidswear, as well as accessories, footwear, fragrances, jewellery, beauty products and includes stores specifically dedicated to both children apparel: The Deal Kids Outlet and luxury footwear: The Shoe Deal Outlet.\r\n\r\nFor fashion-conscious consumers who value quality, luxury and affordability, The Deal is a must-visit destination, all year long.\r\n\r\nFind more creatives here.\r\n\r\nCUSTOMER\r\n\r\nTarget Audience Age Range - 25-45 yrs\r\n\r\nGender Audience - Females & Males. We are a one-stop hub for whole families.\r\n\r\nPEAK TIMES\r\n5pm – 12am\r\nHours 5/6pm & 8/11pm\r\n \r\n\r\nTOP PERFORMING CATEGORIES\r\n\r\nSNEAKERS/ATHLETIC (ALL)\r\nBAGS & LUGGAGE (WOMENS & MENS)\r\nDRESSES (WOMENS)\r\nPOLO TEES (MENS)\r\nSHIRTS  (MENS)\r\nSWIMWEAR (WOMENS & MENS)\r\nSUNGLASSES (WOMENS & MENS)\r\nSANDALS (WOMENS & KIDS)\r\nEAU DE PARFUM (WOMENS & MENS)\r\nSET (WOMENS)\r\n\r\nTOP PERFORMING BRANDS\r\n\r\nTUMI\r\nLACOSTE\r\nSWAROVSKI\r\nLONGCHAMP\r\nKENZO\r\nREPLAY\r\nVILEBREQUIN\r\nROBERTO CAVALLI\r\nMICHAEL KORS\r\nFILA', NULL, 'https://www.thedealoutlet.com/', 'https://bywiola.com/g/wjw0v6sq2u52e070baafb6c5579bcf/', NULL, 'api', '2024-10-23 06:08:14', '2025-01-26 23:00:05', NULL, 'e5d41269-0a97-48f6-bc98-19bcc60f0e9c', NULL),
