tores throughout the UK and Ireland and we ship to 65 countries across the world through newlook.com and our app. Right now, we’re transforming shopping with our digitally-led omnichannel approach, and we’re doing it in a way that stays true to the local high street stores our customers first fell in love with. \r\n\r\nAmongst the influencer edits, design collabs and more sustainable choices, we strive to make feel-good fashion accessible and affordable to all. And as one of the very first high street brands to offer a comprehensive Curves range (that doesn’t compromise on style) – as well as menswear, kids wear, tall, petite and maternity – we’re all about fashion for every body.\r\n\r\nIn line with our aspiration to be climate positive by 2040, we’re investing even more in developing more responsibly sourced collections, whether that’s through using recycled fabrics or supporting Better Cotton. Because we believe in fashion as a force for good. \r\n\r\nThere’s never been a better time to join our family. Help us spread #ThatNewLookFeeling and join the New Look Affiliates Programme today.  \r\n\r\nThe brilliant benefits of joining our Affiliate Programme . . .\r\n\r\n\r\n	30-day cookies\r\n	Comprehensive up-to-date product feeds\r\n	Popular-sized banners\r\n	Unique content available on request\r\n	Exclusive newsletter with hot tips, and news about all our latest offers\r\n\r\n\r\nCommission structure:\r\n \r\n\r\n\r\n	\r\n		\r\n			Commission Group\r\n			Publisher Commission\r\n		\r\n		\r\n			DEFAULT\r\n			0%\r\n		\r\n		\r\n			APP_EXISTING\r\n			0.77%\r\n		\r\n		\r\n			APP_EXISTING_SALE\r\n			0.77%\r\n		\r\n		\r\n			APP_INSTALL\r\n			0.77%\r\n		\r\n		\r\n			APP_NEW\r\n			3.85%\r\n		\r\n		\r\n			APP_NEW_SALE\r\n			1.54%\r\n		\r\n		\r\n			EXISTING\r\n			0.77%\r\n		\r\n		\r\n			EXISTING_SALE\r\n			0.77%\r\n		\r\n		\r\n			NEW\r\n			3.85%\r\n		\r\n		\r\n			NEW_SALE\r\n			1.54%\r\n		\r\n	\r\n', NULL, 'https://www.newlook.com/uk', 'https://ad.admitad.com/g/f81627vfx952e070