0b0-446a-8c7b-96a0610e8372\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\"]', NULL, NULL, 'Increased commission rate from October 26, 2024 till November 8, 2024!\r\n\r\n\r\n	PET: 4,61% --> 6%\r\n	DIGITAL GADGETS: 3,84% --> 5%\r\n	HEALTH: 6,92% --> 9%\r\n	HOME: 6,15% --> 8%\r\n	TOOL: 3% --> 4%\r\n	BEAUTY: 9,2% --> 12%\r\n	INFORMÁTICA Y ELECTRÓNICA: 2,3% --> 3%\r\n	HOME COMPLIANCE: 5,38% --> 7%\r\n	FASHION: 9,2% --> 12%\r\n	MOTHER & BABY: 5,38% --> 7%\r\n	DEFAULT: 2,3% --> 3%\r\n\r\n\r\n*sin incluir IVA ni gastos de envío\r\n\r\nGeneral Briefing - October\r\n\r\nSobre Miravia\r\n\r\nSomos mucho más que una plataforma online de compras. Somos Miravia y queremos satisfacer tu estilo de vida y tus necesidades de forma divertida y sencilla. Disfruta de una aplicación que te permite descubrir las tendencias del momento en moda, maquillaje, zapatos, tecnología, deporte y mucho más. Una selección de grandes y relevantes marcas pensadas para ti. \r\n\r\nVentajas del programa para afiliados\r\n\r\n\r\n	Las comisiones más competitivas del mercado de hasta el 9,2% en la categoría de Fashion.\r\n	Ventana de atribución de 30 días.\r\n	Amplia gama de productos desde fashion hasta electrónica de las mejores marcas.\r\n	Promociones Flash cada día y campañas especiales todos los meses.\r\n	NWLs recurrentes informando de las nuevas campañas y novedades de las marcas.\r\n	Gran crecimiento y trato personalizado para nuestros partners.\r\n\r\n\r\nTipos de partners aceptados\r\n\r\n\r\n	Contenido\r\n	Influencers\r\n	Comparadores de precio\r\n	Loyalty\r\n	Cashback\r\n	Sites de códigos descuento\r\n	Email y display: consultar al contacto del programa\r\n	Otros: a consultar al contacto del programa.\r\n\r\n\r\nValidación de ventas\r\n\r\nEl tiempo máximo de validación de las ventas es de 60 días.\r\n\r\nVentana de atribución\r\n\r\nLa ventana de atribución del programa es de 30 días si durante ese periodo no ha habido interacción con otro canal de marketing.\r\n\r\nDeduplicación\r\n\r\nSe deduplican las ventas con otros canales de marketing de pago.\r\n\r\nComisiones\r\n\r\nMiravia ofrece diferentes comisiones en base a la categoría del producto que pueden ser revisados por el partner. La comisiones comienzan desde el 2,10% sobre el importe de la compra (sin incluir IVA ni gastos de envío).\r\n\r\nImportante: el CPA máximo por venta será de 140€. Si se registra un pedido, en base a las diferentes categorías con un importe elevado el CPA asignado será como máximo de 140€/por venta.\r\n\r\nTérminos y condiciones\r\n\r\nLos partners aceptados en el programa deben revisar detenidamente las condiciones generales que aplican al programa y deberán respetarlas en todo momento.\r\n\r\nRestricciones del programa:\r\n\r\n\r\n	No permitido SEM bajo ningún concepto.\r\n	Los afiliados deben promocionar la marca respetando las condiciones comunicadas por la plataforma de Admitad.\r\n	Los afiliados no deben publicar contenido que de algún modo sea engañoso para el usuario final.\r\n	Cualquier sospecha de fraude o malas prácticas serán sancionadas con la cancelación de comisiones y/o suspensión del partner en el programa.\r\n	El afiliado deberá proporcionar la información requerida por Miravia en caso de tener indicios de fraude.\r\n\r\n\r\nComisiones lanzamiento del programa: \r\n\r\n\r\n	PET: 4,61%\r\n	DIGITAL GADGETS: 3,84%\r\n	HEALTH: 6,92%\r\n	HOME: 6,15%\r\n	TOOL: 3%\r\n	BEAUTY: 9,2%\r\n	INFORMÁTICA Y ELECTRÓNICA: 2,3%\r\n	HOME COMPLIANCE: 5,38%\r\n	FASHION: 9,2%\r\n	MOTHER & BABY: 5,38%\r\n	DEFAULT: 2,3%\r\n\r\n\r\n*sin incluir IVA ni gastos de envío', NULL, 'https://www.miravia.es/', 'https://sgkaa.com/g/7xeenx9ms252e070baaf903dd028f6/', NULL, 'api', '2024-10-23 06:08:14', '2024-10-29 17:30:02', NULL, NULL, NULL),
