('2fdaf4ae-e010-4dcc-9330-3e2225ef8903', NULL, 32932, 78618779, NULL, 'CoolCredit cz', 'CZK', '36', NULL, '41', NULL, NULL, 'Admitad', 'logos/coolcreditcz.svg', 'https://cdn.admitad-connect.com/campaign/images/2023/9/14/32932-c3a1c5af0853c7bb.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '1923', '192300CZK', '30', 0, 0, 0, 0, 1, 0, NULL, '[\"Czech Republic\"]', '[\"b55c8bae-fe47-419d-ad39-602767326bd3\"]', '[\"CZ\"]', NULL, '[\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"256c1471-c8aa-495f-8798-3c059ec9b2cc\"]', '[\"42c36461-beca-4c52-9570-375bb129e816\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\",\"901c1214-e315-4269-b691-e7e23124bb5f\",\"539a1d2f-fc6e-4082-844a-cdbe6517efed\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"efced686-40b0-446a-8c7b-96a0610e8372\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"81864390-a660-477c-82f8-89b3509b7df7\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"965a312f-f3f4-424c-af32-632860fba509\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"8135684a-827b-4322-8872-d0812cbe4b9c\"]', NULL, NULL, 'Společnost COOLCREDIT je tu pro všechny, kteří se náhle ocitnou v finančním stresu způsobeném nečekanými výdajy. Jako česká firma nabízíme podporu v podobě rychlé nebankovní půjčky až do doby výplaty. O tuto půjčku může požádat každý, kdo je starší 18 let, má stálý příjem a trvalé nebo přechodné bydliště na území České republiky.\r\n\r\nNaše půjčky jsou oblíbené především pro svou rychlost – peníze můžete mít na účtu již 10 minut po schválení žádosti. Díky kompletně online procesu žádné zbytečné návštěvy poboček nečekají. Jsme zastánci transparentních úroků, a tedy i férového jednání. Vyřídíme Váš úvěr kdykoliv, i o víkendu a bez nutnosti uvádět důvod půjčky.\r\n\r\nSpolečnost COOLCREDIT se řídí principy zodpovědného půjčování a je držitelem licence České národní banky, což potvrzuje její spolehlivost a důvěryhodnost.\r\n\r\nMaximální výše první půjčky může dosáhnout 15 000 Kč. Po jejím úspěšném splacení můžete zažádat o další úvěr až do výše 25 000 Kč. Doba splacení je flexibilní – můžete si ji nastavit dle svých potřeb a možností v rozmezí od 5 do 30 dní.\r\n\r\n1. **Nečekané finanční problémy?** Nenechte se chytit nepřipraveni! U nás můžete získat rychlou půjčku až do 15 000 Kč. Do 10 minut od schválení žádosti vám peníze připíšeme na účet. Konec dlouhému čekání na peníze, které potřebujete tady a teď.\r\n\r\n2. **Nedostatek peněz do výplaty?** Pokud znáte ten nepříjemný pocit, kdy vám do výplaty zbývají jen drobné a vy si říkáte, jak to vůbec zvládnete, máme pro vás řešení. Díky naší flexibilní půjčce překonáte finanční propast a vydechnete si.\r\n\r\n3. **Obáváte se neprůhledných úroků?** My věříme na férové jednání. Velmi si ceníme důvěry našich zákazníků, a proto jsme zastánci transparentních úroků. U nás víte přesně, kolik a kdy budete platit.\r\n\r\n4. **Nemáte čas chodit na pobočky během pracovní doby?** My rozumíme tomu, že váš čas je drahocenný. Proto jsme tu pro vás kdykoliv - i o víkendu. A to vše bez nutnosti uvádět důvod půjčky.\r\n\r\n5. **Hledáte spolehlivého partnera pro půjčování?** Jsme držiteli licence České národní banky a řídíme se principy zodpovědného půjčování. U nás můžete mít jistotu, že budeme jednat vždy v souladu s pravidly a vašimi zájmy.', NULL, 'https://coolcredit.cz/', 'https://rthsu.com/g/3jz0smt5ci52e070baafe3e2807c9a/', NULL, 'api', '2024-10-23 06:08:14', '2024-10-29 17:30:02', NULL, NULL, NULL);
