elas franquias Samsung e Motorola na região norte, totalizando vinte pontos espalhados pelos estados do Acre, Amazonas, Pará, Rondônia e Roraima.\r\n\r\nEm 2022, foi inaugurada também a AMZ Tech, unidade voltada para negócios B2B, oferecendo o amplo catálogo, vasto estoque e facilidades que só os mais de vinte anos de expertise do Grupo Info Store poderiam oferecer. Hoje, oferecer experiências completas nas lojas e além se tornou uma prioridade para o Grupo, complementando o melhor mix em tecnologia com uma variedade de serviços, como facilidades de pagamento, seguros, RenovaTech, service cards, recargas de celular e muito mais.\r\n\r\n ', NULL, 'https://www.infostore.com.br', 'https://naiawork.com/g/rq0o1qm7ol52e070baaf7b8e659797/', NULL, 'api', '2024-10-23 06:08:14', '2024-10-29 17:30:02', NULL, NULL, NULL),
