('65d3082e-24bc-439d-8796-cc1a39f16615', NULL, 38740, 35979391, NULL, 'Autopiter KZ', 'KZT', '33', NULL, '2052', NULL, NULL, 'Admitad', 'logos/autopiterkz.svg', 'https://cdn.admitad-connect.com/campaign/images/2023/8/8/38740-547b60bef3f46830.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '4.37', '437%', '30', 1, 1, 0, 0, 1, 0, NULL, '[\"Kazakhstan\"]', '\"[\\\"a4ba22bc-1810-44af-8f33-ac18412b5464\\\"]\"', '\"[\\\"KZ\\\"]\"', NULL, '[\"31a83c2d-125c-40f7-a949-ed8229662e60\"]', '\"[\\\"2c50b44b-cddd-4685-8db7-6511bde6cd38\\\",\\\"81864390-a660-477c-82f8-89b3509b7df7\\\",\\\"965a312f-f3f4-424c-af32-632860fba509\\\",\\\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\\\",\\\"6e704421-6015-49fd-ba15-f946556e6e62\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\",\\\"42c36461-beca-4c52-9570-375bb129e816\\\",\\\"643459ce-2619-4819-8a3d-b319aab69d27\\\",\\\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\\\",\\\"901c1214-e315-4269-b691-e7e23124bb5f\\\",\\\"539a1d2f-fc6e-4082-844a-cdbe6517efed\\\",\\\"6857ddf2-e55c-4640-b194-204950ab2ef8\\\",\\\"b3c43963-4397-414e-ad68-19c161924ef1\\\",\\\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\\\",\\\"efced686-40b0-446a-8c7b-96a0610e8372\\\",\\\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\\\",\\\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\\\",\\\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\\\",\\\"35224500-7f53-44ce-a774-d5e2299b9f95\\\",\\\"c88534a9-07a1-4153-b2d3-7c784897d752\\\",\\\"dad9da87-890f-427f-9d9b-aa928841ce09\\\"]\"', NULL, NULL, '\r\n\r\nПодробности бонусной программы по обороту корзины:\r\n\r\n\r\n	Оборот 300 000 тенге - CPS 4.5%\r\n	Оборот 500 000 тенге - CPS 4.7%\r\n	Оборот 1 000 000 тенге - CPS 5%\r\n	Оборот 2 000 000 тенге - CPS 5.2%\r\n	Оборот 3 000 000+ тенге - CPS 5.5%\r\n\r\n\r\nAutopiter.kz - крупнейший интернет-магазин автозапчастей, занимающийся оптовой и розничной продажей запчастей для легковых, грузовых автомобилей, спецтехники и мотоциклов.\r\n\r\nЦА:\r\nГеография:  Казахстан\r\n95% мужчины, от 25-55 лет\r\n-активно интересуются техническим устройством автомобиля, мотоциклов, спецтехники\r\n-менеджер/мастер по СТО, которому нужна деталь\r\n- Доход: средний\r\n \r\n \r\nПреимущества для клиентов:\r\n• Большой ассортимент по выгодным ценам\r\n• Редкие и эксклюзивные запчасти\r\n• Каталоги оригинальных запчастей и аналогов\r\n• Обширная логистика \r\n• Бесплатная доставка «до двери», самовывоз\r\n• Оплата при получении заказа\r\n• Удобная и лояльная система возвратов\r\n• Сроки поставки от 0 дня\r\n• Гарантия на всю продукцию, все заказы тщательно проверяются перед отправкой\r\n• Личный менеджер для решения нестандартных вопросов\r\n• Помощь в подборе автозапчастей\r\n• Бонусные программы\r\n\r\nВниманию партнеров:\r\nОсновная аудитория Autopiter.kz – оптовые Клиенты. Поэтому есть некоторые особенности в работе с заказами оптовых Клиентов.\r\nОплате подлежат:\r\n- все заказы новых Клиентов, \r\n- заказы ранее зарегистрированных на сайте autopiter.kz Клиентов, при условии, что у этих Клиентов не было заказов за последние 3 месяца (реактивированные Клиенты).\r\n\r\n- Заказы совершенные от юридический лиц не оплачиваются, так как это постоянные клиенты, которые регулярно покупают без дополнительного привлечения.\r\n\r\nПреимущества для партнёров:\r\n1) Высокий коэффициент конверсии сайта за счёт популярности бренда\r\n2) Высокая посещаемость \r\n3) 65% покупок совершаются при первом визите\r\n4) Честное подтверждение заявок\r\n5) Достойное вознаграждение за подтвержденную заявку\r\n6) Оперативная сверка и своевременная выплата\r\n7) Специальное предложение для партнёров, привлекающих оптовых клиентов\r\n8) Постоянно работаем над увеличением конверсии\r\n9) Работаем над повышением узнаваемости бренда в online и offline\r\nМы открыты для ваших предложений!\r\n\r\nУважаемые партнёры, в программе категорически запрещена контекстная реклама с использованием ключевых слов \"автопитер\", \"автопитер.rp\", \"autopiter\", \"autopiter.kz\" и их производных в любой вариации, а также в сочетании с любыми другими словами.\r\nТе партнёры, которые будут использовать подобные ключевые слова в контекстной рекламе - будут отключены от партнёрской программы без возможности сохранения заработка.\r\n\r\nС уважением, Партнерская программа Autopiter.kz!\r\n\r\n-------------------\r\n\r\nДля оперативного информирования об изменениях и новостях, подписывайтесь на телеграм-канал Адмитад Казахстан!', NULL, 'https://autopiter.kz/', 'https://xmknb.com/g/ffyafoii2o52e070baafea08f2c368/', NULL, 'api', '2024-10-23 06:08:14', '2025-01-26 22:50:03', NULL, '65d3082e-24bc-439d-8796-cc1a39f16615', NULL),
