я микрокредитных средств).\r\n\r\n\r\nПреимущества партнерской программы:\r\n\r\n\r\n	Микрокредит можно оформить, не выходя из дома или работы, прямо на номер счета (IBAN) карты или номер текущего счета (IBAN) в банке;\r\n	первый микрокредит до 150 000 тенге;\r\n	прозрачные условия получения кредита;\r\n	микрокредит быстро, без залога, без длительных процедур оформления и проверок.\r\n\r\n\r\nРазрешается использование промоматериалов только рекламодателя. Запрашивать дополнительные промо и согласовывать собственные варианты необходимо со службой поддержки сети.\r\nЗа нарушение возможен штраф вплоть до полной отмены конверсий и бан!\r\n\r\nУсловия кредита:\r\n\r\n\r\n	Для всех клиентов: Минимальная сумма микрокредита - 10 000 тенге Максимальная сумма микрокредита - 300 000 тенге Сроки от 5 до 30 дней\r\n	Для новых клиентов: ставка: Срок на 5 дней - 0,01% в день Срок на 10 дней - 2% в день Срок на 15 дней - 1,5% в день Срок на 20 дней - 1,2% в день Срок на 25 дней - 1% в день\r\n	ГЭСВ - ставка от 0,01% в день (от 3,65% годовых) ГЭСВ от 3,7% до 46%*\r\n', NULL, 'https://acredit.kz/', 'https://bywiola.com/g/3qfrpa97lj52e070baaf838ab0aac0/', NULL, 'api', '2024-10-23 06:08:14', '2024-10-29 17:30:02', NULL, NULL, NULL);
