or a high-quality all-inclusive vacation experience. In Mexico and USA\r\n\r\nAbout: Oasis Resorts is a Mexican hotel chain with resorts in Cancun, Riviera Maya, Tulum, and Playa del Carmen. The company offers a variety of all-inclusive resorts, ranging from budget-friendly to luxury. Oasis Resorts is known for its lively atmosphere, its wide range of amenities and activities, and its friendly service.\r\n\r\nLanding Pages:\r\n\r\nhttps://oasishoteles.com/es/hoteles/the-pyramid-at-grand-oasis\r\n\r\nhttps://oasishoteles.com/es/hoteles/grand-oasis-cancun\r\n\r\nhttps://oasishoteles.com/es/hoteles/the-sens-cancun\r\n\r\nhttps://oasishoteles.com/es/hoteles/grand-oasis-palm\r\n\r\nhttps://oasishoteles.com/es/hoteles/oasis-palm\r\n\r\nhttps://oasishoteles.com/es/hoteles/grand-oasis-tulum\r\n\r\nhttps://oasishoteles.com/es/hoteles/oh-cancun\r\n\r\nhttps://oasishoteles.com/es/hoteles/smart-cancun-by-oasis\r\n\r\nhttps://oasishoteles.com/es/hoteles/the-sens-tulum-riviera\r\n\r\nOasis Resorts is a Mexican hotel chain with resorts in Cancun, Riviera Maya, Tulum, and Playa del Carmen. The company offers a variety of all-inclusive resorts, ranging from budget-friendly to luxury. Oasis Resorts is known for its lively atmosphere, its wide range of amenities and activities, and its friendly service.\r\n\r\nOpens in a new windowoasishoteles.com\r\n\r\nOasis Resorts The Pyramid at Grand Oasis Cancun\r\n\r\nSome of the most popular Oasis Resorts include:\r\n\r\n\r\n	The Pyramid at Grand Oasis Cancun: This iconic resort features a pyramid-shaped main building with stunning views of the Caribbean Sea. The Pyramid at Grand Oasis Cancun offers a variety of amenities and activities, including a water park, a nightclub, and several restaurants and bars.\r\n	Opens in a new windowoasishoteles.com\r\n\r\n	Oasis Resorts The Sens Cancun\r\n	\r\n	The Sens Cancun: This adults-only resort offers a more relaxed and luxurious experience. The Sens Cancun features spacious suites with private balconies, a world-class spa, and several gourmet restaurants.\r\n	Opens in a new windowoasishoteles.com\r\n\r\n	Oasis Resorts Grand Oasis Palm\r\n	\r\n	Grand Oasis Palm: This family-friendly resort offers a variety of amenities for all ages, including a kids\' club, a water park, and several restaurants and bars. Grand Oasis Palm is located in the heart of Cancun\'s Hotel Zone, making it close to all the action.\r\n	Opens in a new windowoasishoteles.com\r\n\r\n	Oasis Resorts Grand Oasis Tulum Riviera\r\n	\r\n	Grand Oasis Tulum Riviera: This resort is located in the heart of the Riviera Maya, just a short drive from the Mayan ruins of Tulum. Grand Oasis Tulum Riviera offers a variety of amenities and activities, including a water park, a spa, and several restaurants and bars.\r\n\r\n\r\nOasis Resorts also offers two urban hotels in Cancun:\r\n\r\n\r\n	Oh! Cancun The Urban Oasis: This hotel is located in the heart of Cancun\'s downtown area, making it close to all the shops, restaurants, and nightlife. Oh! Cancun The Urban Oasis offers a variety of amenities and services, including a rooftop pool, a fitness center, and a business center.\r\n	Smart Cancun by Oasis: This hotel is located in the Hotel Zone, close to the beach and all the major attractions. Smart Cancun by Oasis offers a variety of amenities and services, including a pool, a fitness center, and a business center.\r\n', NULL, 'https://oasishoteles.com/es', 'https://xnmik.com/g/hru4rj3gj352e070baafd7da8e2758/', NULL, 'api', '2024-10-23 06:08:14', '2025-01-26 23:00:03', NULL, '96c8e962-456b-4fe3-9b9e-860dd7b30def', NULL),
('e52ac83a-8b46-4bb0-9915-f194296bab3b', NULL, 42148, 30953646, NULL, 'Travelking PL & HU', 'EUR', NULL, NULL, NULL, NULL, NULL, 'Admitad', 'logos/travelkingpl.svg', 'https://cdn.admitad-connect.com/campaign/images/2023/11/1/42148-acc3e8710ac31851.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '3.85', '385%', '30', 1, 0, 0, 0, 1, 0, NULL, '[\"Hungary\",\"Poland\"]', '\"[\\\"87896e59-b1bd-4fb2-aabe-fef329bd307d\\\"]\"', '\"[\\\"PL\\\",\\\"HU\\\"]\"', NULL, '[]', '\"[\\\"42c36461-beca-4c52-9570-375bb129e816\\\",\\\"643459ce-2619-4819-8a3d-b319aab69d27\\\",\\\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\\\",\\\"901c1214-e315-4269-b691-e7e23124bb5f\\\",\\\"539a1d2f-fc6e-4082-844a-cdbe6517efed\\\",\\\"6857ddf2-e55c-4640-b194-204950ab2ef8\\\",\\\"b3c43963-4397-414e-ad68-19c161924ef1\\\",\\\"31a83c2d-125c-40f7-a949-ed8229662e60\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\",\\\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\\\",\\\"efced686-40b0-446a-8c7b-96a0610e8372\\\",\\\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\\\",\\\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\\\",\\\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\\\",\\\"35224500-7f53-44ce-a774-d5e2299b9f95\\\",\\\"c88534a9-07a1-4153-b2d3-7c784897d752\\\",\\\"675670ac-6c51-45cb-bb40-1b16849e9d98\\\",\\\"2c50b44b-cddd-4685-8db7-6511bde6cd38\\\",\\\"81864390-a660-477c-82f8-89b3509b7df7\\\",\\\"965a312f-f3f4-424c-af32-632860fba509\\\",\\\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\\\",\\\"6e704421-6015-49fd-ba15-f946556e6e62\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\\\",\\\"dad9da87-890f-427f-9d9b-aa928841ce09\\\"]\"', NULL, NULL, 'ENG\r\n\r\nDo you love traveling and enjoy spending your free time exploring beautiful places in Poland or abroad? Whether you prefer a relaxing wellness vacation, active time in nature or prefer sightseeing at Travelking you will find the perfect vacation for you.\r\n\r\nAlready more than 900,000 satisfied customers from Poland, the Czech Republic, Slovakia and Hungary have proven that you can rely on Travelking to organize your vacation.\r\n\r\nToday, with Travelking you can choose from more than 900 stays in Poland and 8 other European countries. The most popular among customers are the relaxing wellness stays. Throughout the year, stays in the stunning Austrian mountains and exploring the natural and cultural beauty of Poland are in high demand. In addition, Travelking offers stays in attractive ski resorts such as Austria, Slovakia and Slovenia, where you can spend the perfect (not only) winter holidays.\r\n\r\nIf you\'re a travel lover, you\'ll be happy to know that you can now get a PLN 100 discount on all stays with Travelking. For every purchase of more than PLN 1,000. This includes discounted stays and Travelbomb, which will save you at least another 30% off the price! The money you save will certainly come in handy during your dream stay!\r\n\r\nPL\r\n\r\nKochasz podróże i lubisz spędzać wolny czas na odkrywaniu pięknych miejsc w Polsce lub za granicą? Niezależnie od tego, czy preferujesz relaksujące wakacje z wellness, aktywny czas na łonie natury, czy wolisz zwiedzać zabytki w Travelking znajdziesz idealne wakacje dla siebie.\r\n\r\nJuż ponad 900 000 zadowolonych klientów z Polski, Czech, Słowacji i Węgier udowodniło, że można polegać na Travelking przy organizacji wakacji.\r\n\r\nObecnie z Travelking można wybierać z ponad 900 pobytów w Polsce i 8 innych krajach europejskich. Największą popularnością wśród klientów cieszą się pełne relaksu pobyty wellness. Przez cały rok dużym zainteresowaniem cieszą się pobyty w zachwycających austriackich górach oraz odkrywanie naturalnego i kulturowego piękna Polski. Ponadto w ofercie Travelking znajdują się pobyty w atrakcyjnych ośrodkach narciarskich, takich jak Austria, Słowacja czy Słowenia, gdzie można spędzić idealne (nie tylko) ferie zimowe.\r\n\r\nJeśli jesteś miłośnikiem podróży, z pewnością ucieszy Cię wiadomość, że teraz możesz otrzymać 100 zł zniżki na wszystkie pobyty z Travelking. Za każdy zakup powyżej 1000 zł. Dotyczy to również pobytów zniżkowych i Travelbomb, dzięki którym zaoszczędzisz co najmniej kolejne 30% ceny! Zaoszczędzone pieniądze z pewnością przydadzą się podczas wymarzonego pobytu!\r\n\r\nHU\r\n\r\nSzeretsz utazni, és szívesen töltöd szabadidődet gyönyörű helyek felfedezésével Lengyelországban vagy külföldön? Akár a pihentető wellness-nyaralást, akár a vidéki aktív időtöltést, akár a városnézést kedveli, a Travelkingnél megtalálja a tökéletes nyaralást az Ön számára.\r\n\r\nMár több mint 900 000 elégedett ügyfél Lengyelországból, Csehországból, Szlovákiából és Magyarországról bizonyította, hogy a Travelkingre bátran hagyatkozhat nyaralása megszervezésében.\r\n\r\nMa a Travelkinggel több mint 900 lengyelországi és 8 másik európai országban található szálláshely közül választhat. Az ügyfelek körében a legnépszerűbbek a pihentető wellness-üdülések. Egész évben nagy a kereslet a lenyűgöző osztrák hegyekben való tartózkodásra és Lengyelország természeti és kulturális szépségeinek felfedezésére. Emellett a Travelking olyan vonzó síparadicsomokban kínál üdüléseket, mint Ausztria, Szlovákia és Szlovénia, ahol tökéletes (nem csak) téli vakációt tölthet.\r\n\r\nHa Ön az utazás szerelmese, örömmel fogja tudni, hogy mostantól 100 font kedvezményt kaphat a Travelkinggel történő összes tartózkodásra. Minden 1000 font feletti vásárlás esetén. Ez vonatkozik a kedvezményes üdülésekre és a Travelbombára is, amivel legalább további 30%-ot spórolhatsz az árból! A megtakarított pénz biztosan jól fog jönni az álmai során!\r\n\r\n \r\n\r\n ', NULL, 'https://travelking.pl/', 'https://vxrlm.com/g/dquwu4q32h52e070baaf7eaf385c59/', NULL, 'api', '2024-10-23 06:08:14', '2025-01-26 23:00:05', NULL, 'e52ac83a-8b46-4bb0-9915-f194296bab3b', NULL),
