 - Booking flights at a fraction of the cost\r\n\r\nTop travel destinations:\r\n\r\nCairo, Amman, Jeddah, Riyadh, Manila, Islamabad, Beyrut, Cochin, Alexandria, Multan \r\n\r\nPeak travel period/time for purchases:\r\n\r\nMonday to Thursday between 12PM to 10 PM, annual peak: July to September, April for Eid. \r\n\r\nlastminute.ae was founded in 2023 to guarantee the availability of affordable tourism services to the general public in the Middle East.  \r\n\r\nWe are proud to announce the launch of the lastminute.com brand, with the goal of becoming a leading online tourism brand in our area. With our vast experience, achieved through the sale of millions of flight tickets every year, we provide a HIGH-VALUE/Low-Cost engine for travelers and tourists in one of the most rapidly developing areas in the world. We believe in putting our customers at the center of everything we do, and we will leverage our technological approach and significant collaborations in the tourism industry to provide added value to our clients throughout their journey.', NULL, 'https://www.lastminute.ae', 'https://dorinebeaumont.com/g/1v0gv8b3dz52e070baaf7e9e2498a0/', NULL, 'api', '2024-10-23 06:08:14', '2025-01-26 22:50:07', NULL, 'a79516b1-156d-40e5-9c50-69e0186fd9aa', NULL),
