 самостоятельно, то сделайте их согласно нашему брендбуку и пришлите нам на модерацию. Брендбук: https://hhcdn.ru/file/16540027.pdf\r\n\r\nПосадочные страницы\r\n\r\nМы рекомендуем использовать следующие страницы в качестве посадочных для привлечения ЦА на наш сайт:\r\n\r\n\r\n	https://hh.kz/\r\n	https://hh.kz/b2b\r\n	https://hh.kz/resumesearch и другие.\r\n\r\n\r\nТакже мы собрали страницы всех проф. областей. При интересе работодателя к найму людей определенной профессии, можно сразу предложить посадку на соответствующую страницу, где можно посмотреть и оценить резюме целевых соискателей.\r\n\r\nВажно:\r\n\r\n\r\n	1. Основной страницей для продвижения является https://hh.kz/b2b или https://hh.kz/.\r\n	2. Напоминаем вам о необходимости генерировать партнерскую ссылку на выбранный лендинг.\r\n\r\n\r\nУсловия для партнеров по офферу «Подтвержденный работодатель»\r\n\r\nОплачивается зарегистрированный и подтвержденный welcome-службой работодатель. \r\n\r\nУсловия оффера выполнены, если:\r\n- клиент ранее не регистрировался на hh.kz;\r\n- клиент при регистрации указал контактную информацию, по которой с ним удалось связаться службе первой линии;\r\n- клиент предоставил подтверждающие документы о юр. лице;\r\n- клиент находится в РК и заинтересован в использовании онлайн-рекрутинг платформы HeadHunter;\r\n- регистрация клиента не является фродовой.\r\n\r\nКритерии некачественного (фродового) заказа:\r\n- клиент не знает о том, что он зарегистрирован на HeadHunter;\r\n- клиент не подходит под ГЕО и ЦА (например, юр. лицо не в РК, ошибочная регистрация соискателя, зарегистрировавшаяся компания занимается MLM, незаконной деятельностью, мошенническими схемами);\r\n- клиент мотивирован зарегистрироваться и пройти подтверждение за вознаграждение: мотивированный трафик, трафик с буксов;\r\n- клиента привлекли с сайтов-конкурентов;\r\n- клиента привлекли с нарушением правил данного оффера.\r\n\r\n\r\nПодключайтесь к партнерской программе hh.kz прямо сейчас!', NULL, 'https://hh.kz', 'https://lsuix.com/g/2notnud4ny52e070baaf8c76cb9049/', NULL, 'api', '2024-10-23 06:08:14', '2025-01-26 22:50:06', NULL, '46aca3b5-c0f8-40cf-b87a-8aa607424ec5', NULL),
