('7a095258-16a2-4a97-9998-5cf8f46aef52', NULL, 45391, 64145508, NULL, 'iKiwi MX', 'MXN', NULL, NULL, NULL, NULL, NULL, 'Admitad', 'logos/ikiwimx.svg', 'https://cdn.admitad-connect.com/campaign/images/2023/12/19/45391-d6fc361aaf759bba.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '53', '5300MXN', '30', 1, 0, 0, 0, 1, 0, NULL, '[\"Mexico\"]', '[\"b55c8bae-fe47-419d-ad39-602767326bd3\",\"05547ea7-f472-4f7f-af61-bbda2dc1041d\"]', '[\"MX\"]', NULL, '[\"efced686-40b0-446a-8c7b-96a0610e8372\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\",\"81864390-a660-477c-82f8-89b3509b7df7\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\"]', '[\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"256c1471-c8aa-495f-8798-3c059ec9b2cc\",\"8135684a-827b-4322-8872-d0812cbe4b9c\",\"42c36461-beca-4c52-9570-375bb129e816\",\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\",\"901c1214-e315-4269-b691-e7e23124bb5f\",\"539a1d2f-fc6e-4082-844a-cdbe6517efed\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"965a312f-f3f4-424c-af32-632860fba509\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\"]', NULL, NULL, 'Pay time: 30 days\r\n\r\nCookie time : 30 days\r\n\r\n Ikiwi MX es una plataforma digital que conecta a las empresas fintech que ofrecen productos y servicios financieros con usuarios que buscan este tipo de soluciones en línea. La plataforma ofrece una amplia gama de productos y servicios, incluyendo préstamos, tarjetas de crédito, cuentas de ahorro e inversión.\r\n\r\nObjetivos\r\n\r\nLos objetivos de Ikiwi MX son los siguientes:\r\n\r\n\r\n	Ofrecer una plataforma segura y accesible para que los usuarios puedan comparar y contratar productos y servicios financieros.\r\n	Promover la inclusión financiera, facilitando el acceso a productos y servicios financieros a personas que no están bancarizadas o que tienen dificultades para acceder a ellos.\r\n	Contribuir a la educación financiera de los usuarios, proporcionando información clara y concisa sobre los productos y servicios financieros disponibles.\r\n\r\n\r\nPúblico objetivo\r\n\r\nEl público objetivo de Ikiwi MX son personas de todas las edades y niveles de ingresos que buscan productos y servicios financieros en línea. La plataforma está especialmente diseñada para personas que no están bancarizadas o que tienen dificultades para acceder a productos y servicios financieros tradicionales.\r\n\r\nActividades\r\n\r\nIkiwi MX ofrece una serie de actividades para alcanzar sus objetivos. Estas actividades incluyen:\r\n\r\n\r\n	Una plataforma digital que permite a los usuarios comparar y contratar productos y servicios financieros.\r\n	Una sección de educación financiera que proporciona información sobre los productos y servicios financieros disponibles.\r\n	Una sección de noticias y artículos sobre temas financieros.\r\n\r\n\r\nEstrategia\r\n\r\nIkiwi MX se basa en la siguiente estrategia:\r\n\r\n\r\n	Seguridad y accesibilidad. Ikiwi MX se basa en la seguridad y la accesibilidad para garantizar que los usuarios puedan utilizar la plataforma de forma segura y cómoda.\r\n	Inclusión financiera. Ikiwi MX se basa en la inclusión financiera para facilitar el acceso a productos y servicios financieros a personas que no están bancarizadas o que tienen dificultades para acceder a ellos.\r\n	Educación financiera. Ikiwi MX se basa en la educación financiera para proporcionar información clara y concisa sobre los productos y servicios financieros disponibles.\r\n\r\n\r\nResultados esperados\r\n\r\nLos resultados esperados de Ikiwi MX son los siguientes:\r\n\r\n\r\n	Un aumento de la inclusión financiera en México.\r\n	Una mejora de la educación financiera de los usuarios.\r\n	Una mayor satisfacción de los usuarios con los productos y servicios financieros disponibles.\r\n\r\n\r\nImpacto\r\n\r\nIkiwi MX tiene el potencial de tener un impacto significativo en la inclusión financiera en México. Al facilitar el acceso a productos y servicios financieros a personas que no están bancarizadas o que tienen dificultades para acceder a ellos, Ikiwi MX puede ayudar a:\r\n\r\n\r\n	Reducir la pobreza y la desigualdad.\r\n	Promover el desarrollo económico.\r\n	Mejorar la calidad de vida de las personas.\r\n\r\n\r\nConclusiones\r\n\r\nIkiwi MX es una plataforma digital innovadora que tiene el potencial de transformar la forma en que las personas acceden a productos y servicios financieros en México. Al centrarse en la seguridad, la accesibilidad, la inclusión financiera y la educación financiera, Ikiwi MX puede ayudar a crear un sistema financiero más justo y equitativo.\r\n\r\nAlgunos datos de interés sobre Ikiwi MX:\r\n\r\n\r\n	La plataforma se lanzó en 2022.\r\n	La plataforma cuenta con más de 100 empresas fintech asociadas.\r\n	La plataforma ha ayudado a más de 100.000 personas a acceder a productos y servicios financieros.\r\n\r\n\r\nIkiwi MX es una plataforma prometedora que tiene el potencial de marcar una diferencia positiva en la vida de las personas en México.\r\n\r\n ', NULL, 'https://ikiwi.com.mx/', 'https://lsuix.com/g/fc8uq5ju3852e070baaf155148439f/', NULL, 'api', '2024-10-23 06:08:14', '2024-10-29 17:30:02', NULL, NULL, NULL),
