 fraudulent failed payments / Unauthorized payment details / Multiple unauthorized payments coming from payment details which results in failed payments / Empty bank accounts / etc. detected during or after free trial period ended\r\n» Over 25% of conversions directly cancel within 24 hours after registration\r\n» Multiple leads are generated through the same payment details\r\n» Fake email addresses / accounts\r\n» Double IP addresses\r\nTraffic and conversions coming from publishers showing the above behavior will be rejected and eliminated from the campaign. All realized conversion will be rejected.', NULL, 'https://symphony.live', 'https://ad.admitad.com/g/hv02lljqtk52e070baaf91641a1e28/', NULL, 'api', '2024-10-23 06:08:15', '2025-01-26 23:00:05', NULL, 'a1c061ca-567c-40a2-a0b7-b6e33c77035a', NULL),
