\\",\\\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\"]\"', NULL, NULL, 'Reminiscent of a 16th-century Italian Palace, Palazzo Versace Dubai is a Neoclassical masterpiece with subtle traces of Arabian architecture. Featuring a striking entrance, high ceilings, landscaped gardens, and a range of well-crafted Italian furnishings, the hotel is truly symbolic of the Versace lifestyle.\r\n\r\nLocated in Jaddaf Waterfront, less than 15 minutes away from Dubai International Airport and 8 minutes away from Burj Khalifa and Downtown Dubai, Palazzo Versace Dubai is conveniently located along the shores of the historic Dubai Creek. On arrival one is welcomed by the striking ‘Pietra di Fiume’ design of the iconic Medusa and Greek décor. A walk through the 5-star hotel’s public spaces reveals several exclusive designs and fabrics from Versace, while the lagoon pools and reflection ponds complement the serenity of the lush gardens that surround the hotel – a true luxury retreat for leisure travelers.\r\n\r\nEvery single piece of furniture and fabric that adorns the hotel’s 215 hotel rooms and suites, and 169 residences, is designed and tailor-made by Versace exclusively for the Palazzo Versace Hotel in Dubai. Each of the hotel’s 9 restaurants and bars is designed to have an al fresco terrace to reflect the heritage of Palazzos, where the internal court was the informal space to meet, dine, and enjoy the weather. The three outdoor pools are decorated with mosaic tiles and surrounded by palm trees and flowers. The beautifully landscaped gardens and unobstructed views of the Dubai Creek and skyline, make this luxury hotel an ideal venue for weddings and social events in Dubai.', NULL, 'https://www.palazzoversace.ae/', 'https://xmknb.com/g/6z621dqopy52e070baaf080b20079f/', NULL, 'api', '2024-10-23 06:08:15', '2025-01-26 23:00:03', NULL, '389feb11-a54a-4298-96b9-78001bab2a8b', NULL),
