способы погашения кредита и гарантия безопасности данных клиента.\r\n\r\nДля получения займа необходимо заполнить онлайн-анкету на сайте рекламодателя и дождаться смс-оповещения в течение 2-5 минут. Одобренная сумма будет перечислена на вашу карту, банковский счёт, QIWI-кошелёк.\r\n\r\nПолезная информация по займам:\r\n\r\n\r\n	Сумма займа: от 10 000 до 172 500 тенге\r\n	Срок займа: от 1 до 21 дней\r\n	Ставка: 0,95% в день\r\n\r\n\r\n\r\nТребование к заёмщику:\r\n\r\n\r\n	Гражданство Казахстана\r\n	Наличие паспорта гражданина Казахстана\r\n	Возраст: от 18 до 70 лет\r\n\r\n\r\nСпособы получения:\r\n\r\n\r\n	- выдача на IBAN и по номеру карты\r\n\r\n\r\nСрок получения:\r\n\r\n\r\n	- до 10 минут\r\n\r\n\r\nСпособы погашения:\r\n\r\n\r\n	- оплата банковской картой из личного кабинета на сайте \r\n	- оплата по реквизитам\r\n\r\n\r\n+ у нас акция в КЗ, бессрочная!\r\nЛьготный период 7 дней!\r\nПростые условия – займы под 0,01% по акции \"Льготный период 7 дней!\"\r\nhttps://www.vivus.kz/ru/news/item/23/\r\n\r\n \r\n\r\nМинус-слова\r\n\r\n \r\n\r\nС Уважением, Партнерская программа Vivus!', NULL, 'https://vivus.kz/', 'https://lsuix.com/g/jvp7q38bs952e070baaf53e8f8d388/', NULL, 'api', '2024-10-23 06:08:15', '2025-01-26 23:00:06', NULL, '0dbd765f-0b13-4f71-96ec-38631787bdce', NULL),
