53\\\",\\\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"31a83c2d-125c-40f7-a949-ed8229662e60\\\",\\\"dad9da87-890f-427f-9d9b-aa928841ce09\\\"]\"', NULL, NULL, 'Our Affiliate Programme: Targeted Audience and Requirements\r\n\r\nOur affiliate programme is specifically designed to target audiences in the following European countries: Austria, Bulgaria, Croatia, Denmark, Finland, France, Germany, Greece, Hungary, Iceland, Ireland, Italy, Liechtenstein, Luxembourg, Malta, Netherlands, Norway, Poland, Portugal, Romania,       Slovakia, Slovenia, Spain Sweden. Customers from other countries will NOT be onboarded due to compliance and regulation grounds.\r\n\r\nTo join, new customers must complete a verification process, which requires a valid EU passport / ID / or residence permit, along with proof of address within the EU (utility bill, bank statement, etc.). The onboarding process is realised via the online application, including an Economic profile (key information about the customer) and an appropriateness test (previous experience with different financial products).\r\n\r\nFor more detailed guidelines and to ensure compliance with our marketing standards, please review our Marketing Affiliate Principles and Communications carefully.\r\n\r\nKey Benefits for Affiliates\r\n\r\n·       Regulated and Secure Environment. Earn Broker is the brand name of Top Markets Solutions Ltd which is registered with the Department of Registrar of Companies and Intellectual Property of the Companies of the Republic of Cyprus as a private limited company with registration number HE272810 and is authorized by the Cyprus Securities and Exchange Commission (\"CySEC\") to act as a licensed Cyprus Investment Firm (\"CIF\") with license number 158/11. Top Markets Solutions Ltd operates by the Markets in Financial Instruments Directive (MiFID). This guarantees a secure and transparent trading environment.\r\n\r\n·       Extensive Market Access. Affiliates can promote access to over 15,000 US, European, and Asian stocks, 80,000 bonds, and a selection of investment funds, futures, and options. The platform supports both long-term investments and trading contracts for differences in various financial instruments, including indices, commodities, currencies, and cryptocurrencies​.\r\n\r\n·       Innovative Trading Platforms. We offer advanced, user-friendly trading platforms compatible with both desktop and mobile devices. These platforms are customisable, providing powerful tools and insights to enhance the trading experience​.\r\n\r\n·       Professional Support and Analysis. Affiliates benefit from promoting a platform that offers 24/5 customer support and access to expert research, market reports, and trading ideas. Benefit from advanced AI-powered tools provided by Acuity, including the Signal Centre, which offers news sentiment analysis, actionable trade ideas, and a comprehensive economic calendar.\r\n\r\n·       Secure Funds Management. Client funds are safeguarded in segregated accounts with European and Swiss banking partners, ensuring maximum protection and compliance with strict regulations​. Securities are kept with trusted financial institutions across the world, including UK and US ones.\r\n\r\nTo learn more about the full range of offerings and benefits, visit Earn.broker and Earn.eu  platform\'s websites', NULL, 'https://earn.eu', 'https://grfpr.com/g/oee73ry1x852e070baaf47526a8cb9/', NULL, 'api', '2024-10-23 06:08:15', '2025-01-26 22:50:05', NULL, 'e78b4b2a-a90d-4cf1-9b55-06ca43488a81', NULL),
