му личному менеджеру. \r\n\r\nAirba Fresh - фудтех компания, сервис по доставке продуктов в Алматы. Имеем продукты собственного произвадства (СП) + под собственные торговые марки (СТМ) - фермерская продукция. В добавок есть импортные продукты, например продукция ВкусВилл.\r\n\r\nЗаказы происходят в нашем мобильном приложении, у сайта роль информационной визитки. Также есть оффлайн супермаркет в Алматы. \r\n\r\nДоставка осуществляется с 8:00 до 00:00, Бесплатно при сумме заказа от 5.000 ₸. Обычная слотовая доставка - 2 часа\r\n\r\nЭкспресс-доставка 1.000 ₸ - за 1 час.\r\n\r\nМедианный чек у новичков ~12.000 тг, CR в заказ из инстала ~17%. Средний чек 17.000 тг\r\n\r\nЦА заказывающих: Ж = 75%, М= 25%. Возраст 22-50. Доход средний и выше. Половина женаты/замужем.\r\n\r\n Рекомендации по позиционированию бренда: акцент на промокоды на первый заказ, фермерские продукты, экспресс доставки, удобство\r\n\r\nПопулярные товары у новичков: в основном овощи, фрукты, зелень, яйца и молочка.\r\n\r\nТОП-20 sku\r\n\r\n\r\n	Картофель кг\r\n	Лук репчатый кг\r\n	Бананы кг\r\n	Морковь кг\r\n	Огурцы Миринда кг\r\n	Помидоры черри кг\r\n	Чеснок шт\r\n	Филе куриное Airba Fresh замороженное кг\r\n	Лимон кг\r\n	Огурцы Рава кг\r\n	Свекла кг\r\n	Укроп 100 г\r\n	Шпинат 100 г\r\n	Перец красный светофор кг\r\n	Капуста кг\r\n	Яйцо Казгер-Кұс премиум 15 шт\r\n	Сельдерей стебель кг\r\n	Перец желтый светофор кг\r\n	Киви корзинка шт\r\n	Рукола 100 г\r\n	Яблоки Amal Bio Голден делишес кг\r\n	Голубика 125 г\r\n	Лук зеленый 100 г\r\n	Яблоки Amal Bio Фуджи кг\r\n	Кинза 100 г\r\n	Помидоры красные кг \r\n	Капуста брокколи кг\r\n	Яйцо Казгер-Кұс куриное отборное 30 шт\r\n	Кабачки кг\r\n	Мандарины с листочками кг\r\n', NULL, 'https://airbafresh.kz/', 'https://gndrz.com/g/2fp4pecjin52e070baaff11f9db0bb/', NULL, 'api', '2024-10-23 06:08:15', '2025-01-26 23:00:07', NULL, '90928d7c-1552-43f8-bc7a-0b0a578e4815', NULL),
