29662e60\"]', NULL, NULL, 'CZ\r\n\r\nPojištěná půjčka\r\n\r\nRychlá půjčka na cokoliv, se kterou se nedostanete do problémů, když dlouhodobě onemocníte/ztratíte zaměstnání/se vám stane úraz nebo v dalších neočekávaných situacích.\r\n\r\nPeníze na cokoliv? S Proficrediti v klidu: Soutěž o 3 luxusní párty reproduktory\r\nPojištěná půjčka ve výši až 250 000 Kč. V bannerech se již nachází affiliate odkaz. Mailingové šablony vám dodáme na vyžádání (partnerstvi@proficredit.cz). O produktu: Pojištěná půjčka 10 000 Kč až 250 000 Kč do 24 hodin. Možnost podpisu smlouvy na dálku - bez schůzky s poradcem. Možnost odložení splátek zdarma. Jednoduché vyřízení půjčky i pojištění. Výběr ze 3 balíčků pojištění. Reprezentativní příklad: Úvěr v celkové výši 70 000 Kč, splatnost 48 měsíců, splátka 2 299 Kč, celková splatná částka 110 352 Kč, pevná úroková sazba činí 24,44 % p. a. a RPSN činí 27,37 %. Splátka neobsahuje žádné poplatky za doplňkové služby. Doba trvání spotřebitelského úvěru od 12 až do 48 měsíců. RPSN činí od 27,37 % do 89,8 %.\r\n\r\n\r\nREPREZENTATIVNÍ PŘÍKLAD\r\nÚvěr v celkové výši 70 000 Kč, splatnost 48 měsíců, splátka 2 299 Kč, celková splatná částka 110 352 Kč, pevná úroková sazba činí 24,44 % P.A. a RPSN činí 27.37 %. Splátka neobsahuje žádné poplatky za doplňkové služby. Doba trvání spotřebitelského úvěru od 12 až do 48 měsíců. RPSN činí od 27,37 % do 89,8 %.\r\n \r\n\r\nNově mají spuštěn i podpis na dálku Pojištěné půjčky – to v praxi znamená, že žadatel se vůbec nemusí potkat s úvěrovým poradcem.\r\n\r\nVýhody pojištěné půjčky\r\n• Až 250 000 Kč do 24 hodin\r\n• Podpis na dálku bez nutnosti schůzky s poradcem\r\n• Žádost z pohodlí domova\r\n• Pojištění k půjčce je dobrovolné\r\n• Možnost odložení splátek zdarma\r\n• Jednoduché vyřízení půjčky i pojištění bez nutnosti lékařské prohlídky\r\n• Možnost výběru ze 3 balíčků pojištění\r\n• Platba za pojištění je součástí celkové měsíční splátky\r\n• Oznámení pojistné události možné on-line 24 hodin denně\r\n\r\nNezasílat kontakty s mateřskou! Tyto kontakty totiž neprojdou do smluv!\r\n\r\nENG\r\n\r\nInsured loan\r\n\r\nA quick loan for anything that you won\'t get into trouble with if you get sick for a long time/lose your job/have an accident or in other unexpected situations.\r\n\r\nMoney for anything? Peace of mind with Proficrediti: Competition for 3 luxury party speakers\r\nInsured loan of up to 250,000 CZK. There is already an affiliate link in the banners. We will supply you with mailing templates on request (partnerstvi@proficredit.cz). About the product: Insured loan from CZK 10,000 to CZK 250,000 within 24 hours. The possibility of signing a contract remotely - without meeting with an advisor. Option to postpone installments for free. Easy processing of the loan and insurance. Choice of 3 insurance packages. Representative example: Loan in the total amount of CZK 70,000, maturity of 48 months, repayment of CZK 2,299, total payable amount of CZK 110,352, fixed interest rate of 24.44% p.a. and APR of 27.37%. The installment does not include any fees for additional services. Duration of consumer credit from 12 to 48 months. The APR ranges from 27.37% to 89.8%.\r\n\r\n\r\nREPRESENTATIVE EXAMPLE\r\nLoan in the total amount of CZK 70,000, maturity of 48 months, repayment of CZK 2,299, total payable amount of CZK 110,352, fixed interest rate is 24.44% P.A. and the APR is 27.37%. The installment does not include any fees for additional services. Duration of consumer credit from 12 to 48 months. The APR ranges from 27.37% to 89.8%.\r\n\r\n\r\nThey have also recently launched the remote signature of Insured loans - this means in practice that the applicant does not have to meet with a credit counselor at all.\r\n\r\nBenefits of an insured loan\r\n• Up to 250,000 CZK within 24 hours\r\n• Remote signature without the need to meet with an advisor\r\n• Request from the comfort of your home\r\n• Loan insurance is optional\r\n• Option to postpone installments for free\r\n• Easy processing of the loan and insurance without the need for a medical examination\r\n• Choice of 3 insurance packages\r\n• The insurance payment is part of the total monthly payment\r\n• Claim notification possible online 24 hours a day\r\n\r\nDo not send contacts with maternity! These contacts do not pass into contracts!', NULL, 'https://www.proficredit.cz/', 'https://twnfz.com/g/llgx438gam52e070baaf5f8c52a9ee/', NULL, 'api', '2024-10-23 06:08:15', '2024-10-29 17:30:02', NULL, NULL, NULL),
('2da4bf66-18ca-4926-9c5b-57556d9a6c33', NULL, 100738, 87554276, NULL, 'Hurom PL', 'PLN', '25', NULL, '277', NULL, NULL, 'Admitad', 'logos/hurompl.svg', 'https://cdn.admitad-connect.com/campaign/images/2024/8/6/100738-041bc90914f9a2b0.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '8', '800%', '30', 1, 0, 0, 0, 1, 0, NULL, '[\"Poland\"]', '[\"a4ba22bc-1810-44af-8f33-ac18412b5464\",\"794a7ea7-ca18-44c8-a46a-08ebdfaa587d\",\"8804ede6-cf7b-4b1c-8fb8-703d7450bc23\",\"9b26c2d8-801b-4155-a653-d7aa187f41e6\",\"9d66ecaa-a671-4a5e-ad43-ec410cbf340d\"]', '[\"PL\"]', NULL, '[\"81864390-a660-477c-82f8-89b3509b7df7\",\"efced686-40b0-446a-8c7b-96a0610e8372\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\"]', '[\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"965a312f-f3f4-424c-af32-632860fba509\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"256c1471-c8aa-495f-8798-3c059ec9b2cc\",\"8135684a-827b-4322-8872-d0812cbe4b9c\",\"42c36461-beca-4c52-9570-375bb129e816\",\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\",\"901c1214-e315-4269-b691-e7e23124bb5f\",\"539a1d2f-fc6e-4082-844a-cdbe6517efed\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"dad9da87-890f-427f-9d9b-aa928841ce09\"]', NULL, NULL, 'Krótki Profil Hurom Polska\r\n\r\nHurom Polska jest wiodącym dystrybutorem wyciskarek do soków oraz innych innowacyjnych urządzeń kuchennych na rynku polskim. Firma jest częścią globalnej marki Hurom, która od ponad 40 lat specjalizuje się w produkcji wyciskarek do soków, zdobywając zaufanie klientów na całym świecie dzięki swojej niezawodności, wydajności i zaawansowanej technologii.\r\n\r\nBranża:\r\n\r\n\r\n	AGD, Zdrowie i Wellness\r\n\r\n\r\nProdukty/Usługi:\r\n\r\n\r\n	Wyciskarki: Zaawansowane wyciskarki wolnoobrotowe, które zachowują maksymalną ilość składników odżywczych i witamin w świeżych sokach.\r\n	Blendery i Akcesoria: Wysokiej jakości blendery i akcesoria kuchenne, które ułatwiają przygotowanie zdrowych posiłków.\r\n	Produkty Komplementarne: akcesoria do wyciskarek i inne produkty wspierające zdrowy styl życia.\r\n\r\n\r\nNegatywne Słowa Kluczowe\r\n\r\nProsimy unikać używania następujących słów i fraz w reklamach kontekstowych:\r\n\r\n\r\n	Nazwy konkurencyjnych marek\r\n	Tanie\r\n	Budżetowe\r\n	Niskokosztowe\r\n	Używane\r\n	Przecenione\r\n\r\n\r\nKorzyści dla Klientów\r\n\r\n\r\n	Darmowa Dostawa: Darmowa dostawa przy zamówieniach powyżej 300 PLN.\r\n	Gwarancja 10 lat: Gwarancja Hurom Polska  10 lat w systemie door-to-door.\r\n	Pozytywne Opinie na Stronach Trzecich: Nasze produkty otrzymują doskonałe recenzje na zaufanych stronach internetowych.\r\n	Wysoki Poziom Satysfakcji Klientów: Szczycimy się wysokim poziomem zadowolenia klientów dzięki jakości naszym produktom i wyjątkowej obsłudze.\r\n\r\n\r\nPortret Grupy Docelowej\r\n\r\n\r\n	Płeć: Mężczyźni i kobiety\r\n	Wiek: 25-55 lat\r\n	Dochód: Średni do wysokiego\r\n	Zawód: Profesjonaliści, entuzjaści zdrowego stylu życia, osoby prowadzące gospodarstwo domowe\r\n	Stan Cywilny: Singiel, w związku małżeńskim, rodziny z dziećmi\r\n\r\n\r\nPopularne Produkty\r\n\r\n\r\n	Hurom H320N: Najlepiej sprzedający się model, znany z wydajności i wszechstronności.\r\n	Hurom H400: Popularny model dzięki zaawansowanej technologii (bez metalowych sitek) i doskonałej jakości soku.\r\n	Hurom H330P: Ceniony za łatwość użytkowania i nowoczesny design.\r\n	Hurom M100 2w1: Wszechstronny model idealny do codziennego użytku w kuchni.\r\n\r\n\r\nWskazówki dotyczące Pozycjonowania Marki\r\n\r\nPodkreśl:\r\n\r\n\r\n	Jakość i Innowacyjność: Podkreśl zaawansowaną technologię i wysoką jakość produktów Hurom.\r\n	Korzyści Zdrowotne: Skoncentruj się na korzyściach zdrowotnych wynikających z używania wyciskarek Hurom, takich jak zachowanie składników odżywczych i promowanie zdrowego stylu życia.\r\n	Satysfakcja Klientów: Wspomnij o wysokim poziomie satysfakcji klientów i pozytywnych recenzjach.\r\n	Ekskluzywne Wzornictwo: Zwróć uwagę na unikalny i elegancki design naszych produktów, który stanowi stylowy dodatek do każdej kuchni.\r\n\r\n\r\nSugerowane Słowa/Frazy:\r\n\r\n\r\n	Wysoka Jakość\r\n	Innowacyjna Technologia\r\n	Zdrowotne Korzyści\r\n	Bogate w Składniki Odżywcze Soki\r\n	Łatwe do Czyszczenia\r\n	Elegancki Design\r\n	Zaufana Marka\r\n	Wysokie Oceny Klientów\r\n\r\n\r\n ', NULL, 'https://hurom.pl/', 'https://xmknb.com/g/axlmctgs6u52e070baaf7c8b2d2577/', NULL, 'api', '2024-10-23 06:08:15', '2024-10-29 17:30:02', NULL, NULL, NULL),
