	25-34: 23.7%\r\n	35-44: 21.6%\r\n	45-54: 19.5%\r\n	55-64: 13.9%\r\n	65+: 6.3%\r\n	Geography:\r\n	Global users (excluding Russian and Turkish markets)\r\n\r\n\r\nTop Countries by Sales and Commissions:\r\n\r\n\r\n	USA\r\n	Germany\r\n	Italy\r\n	France\r\n	United Kingdom\r\n	Spain\r\n	Poland\r\n	Romania\r\n\r\n\r\nFor more information, such as changing the format or language of banners, contact the Planetofhotels affiliate team directly.', NULL, 'https://planetofhotels.com', 'https://uhtkc.com/g/zhz7s51tzi52e070baafd0cfe7b65a/', NULL, 'api', '2024-10-23 06:08:15', '2024-10-29 17:30:02', NULL, NULL, NULL);
