('360a6e22-6c4b-4de9-945b-ee922f269f3b', NULL, 100853, 44253772, NULL, 'GoTrip WW', 'EUR', '26', NULL, '3', NULL, NULL, 'Admitad', 'logos/gotripww.svg', 'https://cdn.admitad-connect.com/campaign/images/2024/6/5/100853-bd959407aaeaaf19.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '7', '700%', '30', 0, 0, 0, 0, 1, 0, NULL, '[]', '[\"87896e59-b1bd-4fb2-aabe-fef329bd307d\",\"1bf6b618-0b30-4877-8e46-d61d91e91941\",\"a29987db-2829-46c7-b55d-2647652c4dc5\",\"38689ce9-409b-4dd6-b771-edda90654a00\",\"8e3c5117-58f2-4198-bbad-6af9734689cd\",\"3dbb2f34-675c-4c21-b02f-009cb6887ae2\",\"2acd0d5d-3fb6-4a98-a1db-ce4fdb9cc81d\",\"399935f2-8fa6-4e02-9db2-7bcab76c2fad\",\"76af7e70-8a36-4fff-9c66-00c61137fdc2\",\"6617e5f9-ef49-4cc2-9a74-1100ecfafe7f\",\"f27e5227-f793-4bd5-94f0-1c3a3d018d52\",\"0a21e4bd-beda-413a-8335-62544ae322ed\",\"baa13034-9328-49a6-85af-8fc8f61bcf60\"]', '[\"00\"]', NULL, '[\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"31a83c2d-125c-40f7-a949-ed8229662e60\"]', '[\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"81864390-a660-477c-82f8-89b3509b7df7\",\"965a312f-f3f4-424c-af32-632860fba509\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\",\"42c36461-beca-4c52-9570-375bb129e816\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\",\"901c1214-e315-4269-b691-e7e23124bb5f\",\"539a1d2f-fc6e-4082-844a-cdbe6517efed\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"efced686-40b0-446a-8c7b-96a0610e8372\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"256c1471-c8aa-495f-8798-3c059ec9b2cc\",\"8135684a-827b-4322-8872-d0812cbe4b9c\"]', NULL, NULL, 'Brief profile of the company: \r\n\r\nGoTrip is a travel tech platform that helps travelers plan their route and find private drivers who can transport them along the chosen path. The focus is on tourist transfers to tourist attractions where a customer has an opportunity to select a driver and vehicle from a pre-selected database of drivers that GoTrip team selected, checked and interviewed to provide safety and excellent service for our customers. Currently GoTrip operates in Georgia and Armenia and enterning other markets. The company was founded in Georgia in 2016. It developed and grew, relying solely on its own funds, without attracting external investments. After several pivots, team found our product-market fit in 2017 and began actively working in the Georgian market.  GoTrip is a travel tech platform that helps travelers plan their route and find private drivers who can transport them along the chosen path. At the moment, GoTrip is the leader in the Georgian market. Our startup is well-known among travelers and expats in Georgia. The company was founded in Georgia in 2016. It developed and grew, relying solely on its own funds, without attracting external investments. After several pivots, team found our product-market fit in 2017 and began actively working in the Georgian market.  GoTrip is a travel tech platform that helps travelers plan their route and find private drivers who can transport them along the chosen path. At the moment, GoTrip is the leader in the Georgian market. Our startup is well-known among travelers and expats in Georgia.\r\n\r\nGoTrip - это тревел тех компания, которая предоставляет платформу для выбора водителей и транспортых средств для трансферов в туристические локации. Мы проверяем всех водителей и машины для гарантированного качества и безопасности наших клиентов. На данный момент компания работает на рынках Грузии и Армении.Компания была основана в Грузии в 2016 году. Она развивалась и росла, опираясь исключительно на собственные средства, без привлечения внешних инвестиций. После нескольких поворотов в 2017 году команда нашла соответствие нашего продукта рынку и начала активно работать на грузинском рынке. GoTrip — это туристическая технологическая платформа, которая помогает путешественникам планировать свой маршрут и находить частных водителей, которые смогут перевезти их по выбранному маршруту. На данный момент GoTrip является лидером на грузинском рынке. Наш стартап хорошо известен среди путешественников и эмигрантов в Грузии.\r\n\r\nBenefits for customers: \r\n\r\nКроме всех преимуществ индивидуального трансфера, мы предлагаем:\r\n\r\n\r\n	Бронирование без залога и бесплатная отмена\r\n	Вода в машине для каждого гостя бесплатно\r\n	Ожидание водителем без доплат в течение всего дня\r\n	Неограниченное число остановок фотосессий\r\n	Профессиональные водители\r\n	Детские кресла бесплатно\r\n\r\n\r\nIn addition to all the benefits of an individual transfer, we offer:\r\n\r\n\r\n	Booking without collateral and free cancellation\r\n	Water in the car for each guest for free\r\n	Driver waiting no extra charge at throughout the day\r\n	Unlimited number stops photo sessions\r\n	Professional drivers\r\n	Child boosters/ car seats free of charge\r\n\r\n\r\nTarget audience portrait: \r\n\r\nTourists and groups looking for transfer services with a purpose to visit touristic attractions and explore local attractions and culture via personalized transfer service.\r\n\r\nТуристы и группы, которым нужны услуги трансфера с целью посетить туристические достопримечательности и изучить местные достопримечательности и культуру с помощью индивидуального трансфера.\r\n\r\nPopular products: \r\n\r\nтуристические трансферы за пределы города\r\n\r\ntouristic transfers outside urban zones\r\n\r\nBrand positioning tips: \r\n\r\n\r\n	Миссия: позволить людям чувствовать себя как дома вдали от дома\r\n	Ценности: искренность, щедрость, комфорт, забота, гостеприимство, простота, надежность, семья, безопасность.\r\n\r\n\r\n \r\n\r\n\r\n	Mission: Let people feel at home away from home\r\n	Values: sincerity, generosity, comfort, caring, hospitality, simplicity, reliability, family, security.\r\n', NULL, 'https://gotrip.ge', 'https://rthsu.com/g/fm6zfu49wp52e070baaf0362f7a1df/', NULL, 'api', '2024-10-23 06:08:15', '2024-10-29 17:30:02', NULL, NULL, NULL),
