",\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"81864390-a660-477c-82f8-89b3509b7df7\",\"965a312f-f3f4-424c-af32-632860fba509\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"256c1471-c8aa-495f-8798-3c059ec9b2cc\",\"8135684a-827b-4322-8872-d0812cbe4b9c\"]', NULL, NULL, 'Junte-se à Revolução Educacional com a Galícia Educação!\r\n\r\nA Galícia Educação é uma força transformadora no mundo da educação, com quatro escolas digitais repletas de oportunidades de carreira e negócios incríveis. Nossos programas de certificação e pós-graduação abrangem uma ampla gama de disciplinas, incluindo gestão, coaching, direito e finanças, com um corpo docente e de curadores de renome, como Andrea Schwarz, Dennis Nakamura, Gustavo Cerbasi e muitos outros.\r\n\r\nNossos cursos são muito mais do que apenas certificados; são credenciais de prestígio. Trabalhamos em parceria com instituições de renome, como o Instituto de Coaching da Escola de Medicina de Harvard para coaching, e o Instituto dos Advogados de São Paulo para direito. Todos os nossos programas são reconhecidos pelo MEC, garantindo qualidade e excelência educacional.\r\n\r\nNa Galícia Educação, a inovação está no centro de tudo o que fazemos. Nossa metodologia de ensino é pioneira, fornecendo competências específicas altamente demandadas pelo mercado, desenvolvimento de soft skills essenciais e orientação personalizada. Além disso, conexão com o mercado para trabalhabilidade.\r\n\r\nO melhor de tudo é que nossos cursos estão acessíveis a todos, com opções de pagamento flexíveis, incluindo boletos, cartões e parcelamento com uso do limite de crédito. E a flexibilidade se estende ao seu dispositivo, pois você pode estudar em nossos aplicativos disponíveis para iOS e Android.\r\n\r\nBenefícios:\r\n\r\n\r\n	Aprenda em cursos online reconhecidos pelo MEC\r\n	Aprenda no seu próprio ritmo\r\n	Invista em sua educação com flexibilidade\r\n\r\n\r\nVenham Conferir!', NULL, 'https://gestao.galiciaeducacao.com.br', 'https://ogsib.com/g/1ont9pnvyw52e070baaf6d490dd67a/', NULL, 'api', '2024-10-23 06:09:05', '2024-10-29 17:30:02', NULL, NULL, NULL),
