85-8db7-6511bde6cd38\",\"81864390-a660-477c-82f8-89b3509b7df7\",\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"efced686-40b0-446a-8c7b-96a0610e8372\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\",\"42c36461-beca-4c52-9570-375bb129e816\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\",\"901c1214-e315-4269-b691-e7e23124bb5f\",\"539a1d2f-fc6e-4082-844a-cdbe6517efed\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"256c1471-c8aa-495f-8798-3c059ec9b2cc\",\"8135684a-827b-4322-8872-d0812cbe4b9c\",\"965a312f-f3f4-424c-af32-632860fba509\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"dad9da87-890f-427f-9d9b-aa928841ce09\"]', NULL, NULL, 'Український Хостинг провайдер, працює з 2009 року та надає широкий спектр послуг хостингу:\r\n\r\n- Віртуальний хостинг сайтів з Безкоштовним конструктором сайтів;\r\n\r\n- Віртуальні виділені сервера VPS/VDS з Безкоштовним адмініструванням 24/7;\r\n\r\n- Виділені сервера з адмініструванням;\r\n\r\n- Послуги з реєстрації доменів, установки SSL сертифікатів та підключення CDN\r\n\r\n- Віддалені робочі столи на Windows (оф.ліцензія), з цілодобовою роботою навіть в період блекаутів\r\n\r\nПершими в Україні запустили в 2021-му році послугу \"Вічного Хостинга\" - клієнт оплачує лише один рахунок і жодних оплат за подовження, індексацій та зміни ціни.\r\n\r\nПостійні користувачі відзначають серед найбільших переваг:\r\n\r\n- Живе спілкування менеджерів в онлайн чаті та по телефону;\r\n\r\n- Цілодобову професійну, власну тех.підтримку\r\n\r\n- Базове безкоштовне адміністрування усіх послуг клієнтів\r\n\r\nДля клієнтів, що змінюють хостера діє програма \"Переходь в Гіпер\". Компанія підбирає оптимальний тариф, безкоштовно переносить дані клієнта, тестує швидкість роботи сайту, оптимізує та проводить аудит. Та саме головне - ГіперХост врахує раніше сплачені кошти старому провайдеру в рахунок оплати нового хостингу.\r\n\r\nКомпанія офіційно зареєстрвоана під торгівельною маркою HyperHost.UA, та являється активним учасником системи прозорих закупівель Prozorro, що підтверджує високу відповідність стандартам галузі.', NULL, 'https://hyperhost.ua/', 'https://rcpsj.com/g/4y24lnxl7f52e070baaf7f67b8171e/', NULL, 'api', '2024-10-23 06:09:05', '2024-10-29 17:30:02', NULL, NULL, NULL),
