n el mundo del retail, ofreciendo una amplia gama de productos deportivos, moda, accesorios, telefonía, muebles y servicios financieros. Nuestra red incluye más de 250 tiendas dportenis/dpstreet y 48 oficinas dpvale distribuidos en 19 estados y 49 ciudades de México. Con más de 3,300 colaboradores y 45,000 distribuidores, nuestro impacto es tangible y en constante expansión. Estamos orgullosos de ocupar el puesto 24 en el Ranking Nacional Súper Empresas de Top Companies, un testimonio de nuestra sólida cultura y valores. Además, nuestro compromiso con la responsabilidad social, económica y ambiental ha sido reconocido por el Centro Mexicano para la Filantropía (Cemefi) con el distintivo Empresa Socialmente Responsable durante 7 años consecutivos. En Grupo dportenis, nos mueve un propósito claro y transformador: facilitar estilo y mejora calidad de vida.\r\n\r\n ', NULL, 'https://www.dportenis.mx/', 'https://wbbsv.com/g/r02nh4se2852e070baaf2e72d78f0c/', NULL, 'api', '2024-10-23 06:09:05', '2025-01-26 23:00:08', NULL, 'a44432a7-9eba-4ad3-9162-3e3361dcd9d3', NULL),
