('1d3edd77-3106-483f-9afb-df3d01ab4ca3', NULL, 27953, 75148888, NULL, 'Travel Supermarket UK', 'GBP', '93', NULL, NULL, NULL, NULL, 'Admitad', 'logos/travelsupermarketuk.svg', 'https://cdn.admitad-connect.com/campaign/images/2024/1/12/27953-ba206d2ba943c450.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '13.08', '000769%1541308GBP', '30', 1, 0, 0, 0, 1, 0, NULL, '[\"United Kingdom\"]', '\"[\\\"87896e59-b1bd-4fb2-aabe-fef329bd307d\\\",\\\"1bf6b618-0b30-4877-8e46-d61d91e91941\\\",\\\"38689ce9-409b-4dd6-b771-edda90654a00\\\",\\\"0a21e4bd-beda-413a-8335-62544ae322ed\\\"]\"', '\"[\\\"GB\\\"]\"', NULL, '[\"81864390-a660-477c-82f8-89b3509b7df7\",\"965a312f-f3f4-424c-af32-632860fba509\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\",\"efced686-40b0-446a-8c7b-96a0610e8372\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\"]', '\"[\\\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\\\",\\\"efced686-40b0-446a-8c7b-96a0610e8372\\\",\\\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\\\",\\\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\\\",\\\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\\\",\\\"35224500-7f53-44ce-a774-d5e2299b9f95\\\",\\\"c88534a9-07a1-4153-b2d3-7c784897d752\\\",\\\"42c36461-beca-4c52-9570-375bb129e816\\\",\\\"643459ce-2619-4819-8a3d-b319aab69d27\\\",\\\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\\\",\\\"901c1214-e315-4269-b691-e7e23124bb5f\\\",\\\"539a1d2f-fc6e-4082-844a-cdbe6517efed\\\",\\\"6857ddf2-e55c-4640-b194-204950ab2ef8\\\",\\\"b3c43963-4397-414e-ad68-19c161924ef1\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\",\\\"2c50b44b-cddd-4685-8db7-6511bde6cd38\\\",\\\"81864390-a660-477c-82f8-89b3509b7df7\\\",\\\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\\\",\\\"6e704421-6015-49fd-ba15-f946556e6e62\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\\\",\\\"675670ac-6c51-45cb-bb40-1b16849e9d98\\\",\\\"dad9da87-890f-427f-9d9b-aa928841ce09\\\"]\"', NULL, NULL, 'Who Are We?\r\n\r\nTravelSupermarket is a travel site which offers people in the UK all the comparison tools they need when they’re planning their holiday and want to find the very best one for them.\r\n\r\nWe compare Package Holidays, Car Hire, Flights, Hotels, Holiday Extras, Travel Insurance and dynamic packaging by searching hundreds of travel websites. The information supplied is unbiased and designed to save our customers time and money.\r\n\r\nWe thrive on offering our users accurate real-time availability by taking information directly from suppliers such as Opodo, British Airways, First Choice, Thomson, Holiday Autos, Auto-Europe and many more, ensuring users are presented the best possible price at all times.\r\n\r\nTravelSupermarket is part of the MoneySupermarket.com Group PLC.\r\n\r\nOur affiliate scheme will focus on click outs to our partner sites on our Holidays and Car Hire channels and sales to our Hotels and Travel Insurance channels.\r\n\r\nWhy Work With Us?\r\n\r\n\r\n	We search 1,000s of individual Package Holidays from over 34 suppliers\r\n	We search over 200 individual Car Hire providers from over 21 suppliers\r\n	We partner with Hotelscombined to source great Hotel deals, in the UK and abroad\r\n	We search 400+ holiday insurance policies from over 50 providers.\r\n	70% visit to click out rate on average\r\n	Site visitors pre Corona: 1 million unique visits per month\r\n	Ability to deep link directly to our results pages\r\n\r\n\r\nHow to populate offers from TravelSupermarket\r\n\r\nWe ensure all internal tracking parameters such as Google Analytics UTM and our own source codes are auto appended by Admitad. This means that all you have to do is find the right link for your activity, easy.\r\n\r\nFor detailed promotional information, please refer to the Publisher pack in the Documents section of the TravelSupermarket profile\r\n\r\nHotels\r\n\r\nOption 1: Generic Hotels landing page\r\n\r\n\r\n	Link directly to the Hotels landing page: https://hotels-affiliates.travelsupermarket.com/\r\n\r\n\r\nOption 2: Deeplink to the destination search result\r\n\r\nTo do this take the link to our Hotels landing page (see URL above), populate the destination and date and hit search to get the deeplink URL. Keep in mind that once the date of departure has expired the user will be redirected to the generic destination landing page. See an example below of what this will look like for London Hotel searches:\r\n\r\n\r\n	https://hotels-affiliates.travelsupermarket.com/hotels/London,England,United-Kingdom-c28501/2022-01-01/2022-01-02/2adults?placeId=P158584&placeName=place:London&sort=rank_a\r\n\r\n\r\n \r\n\r\n\r\n	Redirecting deeplink into the generic destination page (default) upon date expiration\r\n	\r\n		https://hotels-affiliates.travelsupermarket.com/Place/London.htm\r\n	\r\n	\r\n\r\n\r\nOption 3: Deeplink into the specific Hotels page\r\n\r\n\r\n	Lastly, you can also link to a named hotel by destination. You can do this by populating the destination and dates within the gadget and hit search.\r\n	Here is an example of what a URL will look like for this result:\r\n	\r\n		London:  https://hotels-affiliates.travelsupermarket.com/Place/London.htm\r\n		Then select Hotel of choice i.e. Park Plaza Westminster Bridge London: https://hotels-affiliates.travelsupermarket.com/hotels/Park-Plaza-Westminster-Bridge-London,London-c28501-h315921-details/2022-01-01/2022-01-02/2adults?sid=HRGEHLKlW3#header\r\n	\r\n	\r\n\r\n\r\nHow do TravelSupermarket pay Hotels Affiliate Commissions?\r\n\r\nTravelSupermarket pay 5 % commission of the total booking value.\r\n\r\nFor example, if a user purchases a £100 Hotel then this will result in the following commission payable:\r\n\r\n\r\n	Total booking value £100 x 5% = £5 commission\r\n\r\n\r\nCar Hire\r\n\r\nOption 1: Generic Car Hire landing page\r\n\r\n\r\n	Link directly to the Car Hire landing page:  https://www.travelsupermarket.com/en-gb/car-hire/\r\n	We wouldn’t advise on deeplinking to the search results page currently as we don’t have a dynamic rolling date variable within the URL, like for Holidays. Therefore, please avoid deeplinking to prevent expiration of search results once the date within the URL has elapsed.\r\n	PLEASE NOTE:. Due to the current tracking set up, the commission will manually be amended from a static number (£1.04) to 5 % of the booking value.\r\n\r\n\r\nTravel Insurance\r\n\r\nGeneric Travel Insurance landing page\r\n\r\n\r\n	Link directly to the Travel Insurance landing page: https://www.travelsupermarket.com/en-gb/travel-insurance/\r\n\r\n\r\nHolidays\r\n\r\nOption 1: Generic Holidays landing page\r\n\r\nLink users to our Holidays landing page using the following URL:\r\n\r\n\r\n	https://www.travelsupermarket.com/en-gb/holidays/\r\n\r\n\r\nOption 2: Deeplinking into search results\r\n\r\n\r\n	To do this you will need to prepopulate the search gadget with:\r\n\r\n\r\n\r\n	City of departure\r\n	Destination\r\n	Departure date\r\n	Number of nights\r\n	Number of people\r\n\r\n\r\n\r\n	Click search and copy the URL link. This should look something like this:\r\n\r\n\r\n\r\n	https://www.travelsupermarket.com/en-gb/holidays/results/5310a3fa823ab0522c0a32d4/54ad584b5218c8b2db215299/2017-11-06/7/?room=A2&f_min_guest_rating=3&preFilterTripAdvisor=true\r\n\r\n\r\n\r\n	If you are deeplinking into the Search Results page, you will need to make the following date amend to the “Holidays link”: This is because existing Holiday URLs have a fixed date, therefore if you choose a specific date the URL will expire after that date has elapsed:\r\n\r\n\r\n \r\n\r\n\r\n	https://www.travelsupermarket.com/en-gb/holidays/results/5310a3fa823ab0522c0a32d4/54ad584b5218c8b2db215299/2017-11-06/7/?room=A2&f_min_guest_rating=3&preFilterTripAdvisor=true\r\n\r\n\r\n\r\n	In order to avoid this you will need to amend the date by replacing bold \"2017-11-06\" with \"dynamic/14\". This will ensure a 14-day rolling date. The URL structure should look something like this:\r\n\r\n\r\n\r\n	https://www.travelsupermarket.com/en-gb/holidays/results/5310a3fa823ab0522c0a32d4/54ad584b5218c8b2db215299/dynamic/14/7/?room=A2&f_min_guest_rating=3&preFilterTripAdvisor=true\r\n\r\n\r\nYou are free to choose the length of time you would like the URL to roll over dates. For example, you can use 14 for a 14-day window, or 7 for 7 days, or 28 for 28 days.\r\n\r\nCookie Window\r\n\r\nWe operate a 30 days cookie window, except for Car hire and Holiday where we operate a 30-minute session window and last click attribution model. Only click outs and sales within this window will be validated.\r\n\r\nTravelSupermarket do not allow site scrapes.', NULL, 'https://www.travelsupermarket.com/', 'https://ad.admitad.com/g/l6mjrn9hdo52e070baafab4e0841e7/', NULL, 'api', '2024-10-24 07:03:15', '2025-01-26 23:00:05', NULL, '1d3edd77-3106-483f-9afb-df3d01ab4ca3', NULL),
