a312f-f3f4-424c-af32-632860fba509\\\",\\\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\\\",\\\"6e704421-6015-49fd-ba15-f946556e6e62\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\"]\"', NULL, NULL, 'edX is the trusted platform for education and learning. Founded by Harvard and MIT, edX is home to more than 20 million learners, the majority of top-ranked universities in the world, and industry-leading companies. As a global nonprofit, edX is transforming traditional education, removing the barriers of cost, location and access.\r\n\r\nOffering 2000 online courses from 140 leading institutions, edX helps people gain new skills, advance their careers, or learn for fun with courses in computer programming, data science, business, finance, marketing, engineering, language, humanities, science and more. \r\n\r\nAlmost all courses on edX are free to try. For a fee, learners can submit graded assignments and earn certificates of completion which can be highlighted on their resumes or LinkedIn profile. This is the commissionable part of the program.\r\n\r\nMany of our courses are part of larger programs for learners to acquire deep skills in a field. Our MicroMasters programs consist of a series of graduate level courses for those looking for advanced training and our Professional Certificate programs provide a career pathway for those new to a field.\r\n\r\nWE OFFER ONLINE COURSES IN SUBJECTS LIKE:\r\nComputer science – Learn how to code! Learn computer programming with beginner and advanced courses in Python, C, C++, Java, R programming, HTML, CSS, Javascript, Hadoop, Excel, etc. Learn artificial intelligence, machine learning, big data, cloud computing, cybersecurity, network security, information technology, mobile development, game design, virtual reality and more. \r\n\r\nBusiness & Management - Courses in accounting, marketing management, digital marketing, marketing analytics, finance, economics, IT, supply chain, entrepreneurship, operations management, health care administration, fintech, public speaking and more.\r\n\r\nMathematics - from high school to college-level math courses, master calculus, statistics, algebra, regression and more.\r\n\r\nScience & Engineering - Top online courses in biology, anatomy, life science, chemistry, physics, and various engineering courses including manufacturing, material science, robotics, electrical engineering, mechanical engineering, and civil engineering.\r\n\r\nLanguage - Learn Spanish, Chinese, French, English, and even sign language.\r\n\r\n2000 courses in additional subjects including art, law, politics, history, architecture, philosophy, literature, food and nutrition, health and wellness, developmental and behavioral psychology, etc.\r\n\r\nMasters - Publishers are unable to promote Masters courses, however are able to promote Micromasters.\r\n\r\nTraffic from cashback sites is forbidden.', NULL, 'https://www.edx.org/', 'https://bywiola.com/g/4wbjsbmozs52e070baafd629c4b097/', NULL, 'api', '2024-10-24 07:03:14', '2025-01-26 22:50:05', NULL, '406f2179-b7e0-4616-900c-24a9530ff4b9', NULL);
