botanicals, crafted with advanced derma-science and technical edge, gorgeous Mediterranean aromatics and feel-good textures that feel like cashmere.\r\n\r\n\r\nWe are delighted to be featured in the UK\'s top publications including, Glamour, Grazia, Cosmopolitan and Stylist Magazine, to name a few as well as fantastic reviews from numerous beauty and lifestyle bloggers that promote our products.\r\nWe are proud to offer excellent customer service and quick and reliable delivery to our valued customers and hope to increase our reach by with fantastic support to our publishers.\r\n\r\n\r\nBenefits for publishers\r\n\r\n \r\n\r\n\r\n	Competitive commission. We are also happy to enter into discussions about raising the default rate of commission based on top performing affiliates.\r\n	Customer promotions updated on a monthly basis\r\n	Our average basket value is currently at £65 and we have a long list of returning, committed customers so truly believe that affiliates can earn multiple commissions within our 30-day cookie period.\r\n	Free delivery on order over £50 plus sample programme\r\n	Templespa provides a comprehensive selection of creative banners both static and animated. Templespa are more than happy to accommodate for any bespoke banner requirements.\r\n	30 day Cookie period Regular communication & a designated point of contact.\r\n\r\n\r\nBenefits for customers\r\n\r\n\r\n	A fully responsive site for enjoyable customer journey.\r\n	Delivery Costs - Standard UK Delivery is £3.95 and if the total basket value exceeds £50, then Standard UK Delivery is free. Express UK Delivery is £6.95 and if the total basket value exceeds £50, then Express Delivery is reduced to £3.\r\n	Our products are 100% cruelty free with many of our products being vegan too\r\n	We create exceptional skincare products and experiences that make a real difference to your skin health and soul health. We believe that your body is a living temple. Honour it, enjoy your life and live it to the full.\r\n	Winner in 14 categories in the 2020 Beauty Bible Awards\r\n\r\n\r\nPeculiarities\r\n\r\n\r\n	Please note that commissions are paid on total basket value minus VAT, delivery costs and any discount that has been applied at checkout.\r\n	Transactions are validated once orders have been dispatched and the 28 day returns policy has expired.\r\n\r\n\r\nLimitations\r\n\r\n\r\n	Brand-bidding is strictly prohibited. Publishers will be blocked if any violations may occur.\r\n\r\n\r\n \r\n\r\n \r\n\r\n ', NULL, 'https://www.templespa.com/', 'https://rzekl.com/g/lhjzq5xnmv52e070baaf72a6d6964f/', NULL, 'api', '2024-10-24 07:03:14', '2025-01-26 23:00:05', NULL, 'a6f89da7-3988-476b-91a2-fc16ba7e1815', NULL),
