('c87ce15e-c192-4036-8284-0659493c4946', NULL, 19854, 71648283, NULL, 'Prom UA', 'UAH', NULL, NULL, NULL, NULL, NULL, 'Admitad', 'logos/promua.svg', 'https://cdn.admitad-connect.com/campaign/images/2021/4/21/19854-b9c5d718248cded4.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '17.69', '1769UAH', '30', 1, 0, 0, 0, 1, 0, NULL, '[\"Ukraine\"]', '[\"a4ba22bc-1810-44af-8f33-ac18412b5464\"]', '[\"UA\"]', NULL, '[\"643459ce-2619-4819-8a3d-b319aab69d27\",\"965a312f-f3f4-424c-af32-632860fba509\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\",\"901c1214-e315-4269-b691-e7e23124bb5f\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"dad9da87-890f-427f-9d9b-aa928841ce09\"]', '[\"42c36461-beca-4c52-9570-375bb129e816\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"8135684a-827b-4322-8872-d0812cbe4b9c\",\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"539a1d2f-fc6e-4082-844a-cdbe6517efed\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"c88534a9-07a1-4153-b2d3-7c784897d752\"]', NULL, NULL, 'Prom.ua — найбільший торговий майданчик України з величезним асортиментом від продавців з усієї країни.\r\n\r\nProm.ua — лідер онлайн-торгівлі України, щомісячно сайт відвідують близько 33 млн відвідувачів. Тут покупці забезпечені комфортним, доступним та безпечним онлайн-шопінгом.\r\n\r\nЗверніть увагу, що модерація може відбуватись із затримкою, бо кожна площадка перевіряється рекламодавцем.\r\nВажливо! Якщо вам не вдається подати заявку на підключення до партнерської програми, прохання звертатися до менеджера партнерскої програми у тикет або через вашого менеджера.\r\n\r\n– Час життя cookie складає 30 днів.\r\n– Замовлення з порожнім рефером кліку (неможливо подивитись джерело трафіку) будуть відхилені.\r\n– Просимо звернути увагу на правила офферу, у разі невиконання яких продажі будуть відхилені, і веб-майстер може бути відключений від партнерської програми:\r\n\r\n1. Заборонено приймати участь у будь-яких кампаніях Пошукової оптимізації (SEO) або Пошукового маркетингу (SEM), використовуючи бренд \"Пром\", “Prom”, включаючи відмінювання і неправильне написання.\r\nСторінки, які вже оптимізовані під запит, необхідно приховати від індексування у Google и Яндекс.\r\n\r\n2. Використовуючи Deeplink, не можна вести на: Сайти продавців. Приклад https://zirca.prom.ua/\r\n\r\n3. Заборонено використання бренду Prom при створені груп, спільнот у соцмережах, месенджерах.\r\n\r\n4. Трафік з соцмереж Vkontakte, Одноклассники, з сайтів .рф/.ru, а також з інших, заборонених сайтів в Україні заборонено.\r\n\r\n5. Заборонено використовувати не описані/не дозволені у офері види трафіку.\r\n\r\n6. Якщо вебмайстер є партнерською мережею, яка хоче взяти офер на resale, їй необхідно налаштувати передачу всіх параметрів своїх вебмайстерів аналогічно тому, як це робить партнерська мережа, у якій беруть офер на resale.\r\nА саме необхідно передавати в subid:\r\n- логін вебмайстра з партнерської мережі;\r\n- ID вебмайстра;\r\n- тип трафіку:\r\n     content - купони, знижки, промокоди, акції і тд.\r\n     banner\r\n     teaser\r\n     youtube\r\n     messenger\r\n     push\r\n     pop-up\r\n     social - трафік с соц.мереж\r\n     KMC - контекстно-медійна мережа\r\n     homepage - закладки на головній сторінці браузера\r\n- ID майданчика/сайту;\r\n- referer\r\nВ разі відсутності коректної передачі параметрів, рекламодавець залишає за собою право відхилити замовлення даному вебмайстру і відключити його від офера.\r\n\r\nУ разі першого порушення правил партнерської програми, вебмайстру відхиляються замовлення за останні 7 днів, з моменту фіксації порушення. У разі повторного порушення, вебмайстр відключається від партнерської програми та йому відхиляються замовлення за останні 10 днів (або на розсуд рекламодавця).', NULL, 'https://prom.ua/', 'https://ogsib.com/g/wyamd0bffp52e070baafd961c95091/', NULL, 'api', '2024-10-24 07:03:14', '2024-10-29 17:30:02', NULL, NULL, NULL),
('633c7354-82ea-48f6-a142-acedb75d6b1f', NULL, 18153, 98814914, NULL, 'Economybookings Many GEO\'s', 'EUR', '45', NULL, '7', NULL, NULL, 'Admitad', 'logos/economybookingsmanygeos.png', 'https://cdn.admitad-connect.com/campaign/images/2020/10/2/18153-cc5470d792ef365d.png', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '50.77', '5077%', '45', 1, 0, 0, 0, 1, 0, NULL, '[\"Canada\",\"Russia\",\"United Kingdom\",\"United States\"]', '\"[\\\"87896e59-b1bd-4fb2-aabe-fef329bd307d\\\",\\\"8e3c5117-58f2-4198-bbad-6af9734689cd\\\"]\"', '\"[\\\"US\\\",\\\"RU\\\",\\\"CA\\\",\\\"GB\\\"]\"', NULL, '[\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"31a83c2d-125c-40f7-a949-ed8229662e60\",\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\"]', '\"[\\\"2c50b44b-cddd-4685-8db7-6511bde6cd38\\\",\\\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\\\",\\\"35224500-7f53-44ce-a774-d5e2299b9f95\\\",\\\"c88534a9-07a1-4153-b2d3-7c784897d752\\\",\\\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\\\",\\\"42c36461-beca-4c52-9570-375bb129e816\\\",\\\"643459ce-2619-4819-8a3d-b319aab69d27\\\",\\\"6e704421-6015-49fd-ba15-f946556e6e62\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\\\",\\\"675670ac-6c51-45cb-bb40-1b16849e9d98\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\",\\\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\\\",\\\"539a1d2f-fc6e-4082-844a-cdbe6517efed\\\",\\\"6857ddf2-e55c-4640-b194-204950ab2ef8\\\",\\\"b3c43963-4397-414e-ad68-19c161924ef1\\\"]\"', NULL, NULL, 'Партнерская программа Economybookings Many GEO\'s\r\n\r\nОбращаем ваше внимание, что на данный момент на стороне Адмитад техническая возможность маркировки рекламы и передачи данных в ОРД в оффере отсутствует.\r\n\r\nEconomybookings.com - один из лидеров в сфере онлайн-бронирования автомобилей в более чем 150 странах мира.\r\n\r\n\r\n	Economybookings.com работает в сфере онлайн-бронирования автомобилей с 2008 года. В данный момент Economybookings.com занимает лидирующие позиции в Европе в сфере онлайн-бронирования автомобилей и предлагает широкий спектр услуг в 150 странах.\r\n	Компания имеет как минимум 3-4 поставщика авто прокатных услуг в каждом городе. Это обеспечивает высокий уровень обслуживания клиентов.\r\n\r\n\r\nПолитика Economybookings.com такова: \r\n\r\n\r\n	Мы с клиентом во время бронирования, во время аренды и после аренды авто.\r\n	Наши клиенты всегда могут чувствовать себя защищенными, так как все вопросы связанные с бронированием и арендой помогают решать специалисты с большим опытом работы в прокатных компаниях.\r\n	Только у нашей компании работает круглосуточный телефон поддержки.\r\n	Сайт нашей компании устроен так, что клиент получает максимум информации о будущей аренде.\r\n	Отметим, что у нас активно работает call-центр и, если Вы не нашли ответ на нашей домашней странице, на все вопросы Вы получите ответ по телефону. Наши операторы знают ответы на все вопросы.\r\n	Благодаря сотрудничеству с сотнями прокатных компаний, являющихся лидерами как на мировом, так и на местном рынке, Economybookings.com предоставляет широкий выбор автомобилей всех классов и находит лучшие предложения для ваших поездок.\r\n\r\n\r\nТОП-10 направлений, куда путешествуют наши клиенты:\r\n\r\n\r\n	США Флорида\r\n	Италия\r\n	Канада\r\n	Австралия\r\n	Испания \r\n	США Калифорния \r\n	США Гавайи \r\n	Португалия\r\n	Греция\r\n	Великобритания\r\n\r\n\r\nПрисоединяйтесь к партнерской программе Economybookings Many GEO\'s!', NULL, 'https://www.economybookings.com/', 'https://ujhjj.com/g/gtmfscgipy52e070baaf1985193de8/', NULL, 'api', '2024-10-24 07:03:14', '2025-01-26 22:50:05', NULL, '633c7354-82ea-48f6-a142-acedb75d6b1f', NULL),
