rnational GmbH продает туры и туристические услуги более чем в 20 странах мира. В рамках партнерской программы “TEZ экскурсии – www.tezeks.com” предлагаются групповые и индивидуальные экскурсии на русском языке, билеты на мероприятия культурного и развлекательного характера в 22 странах мира, список которых постоянно расширяется.\r\n\r\nГеография:  Россия (крупные города), страны СНГ (вкл. Беларусь, Казахстан, Армению), страны Средней Азии, Украина, Грузия, Азербайджан, страны Прибалтики, Израиль, США, Канада, Германия.\r\n\r\nПреимущества для покупателей\r\n\r\n\r\n	Продажа мест в группе, от одного человека.\r\n	Доступные цены групповых экскурсий.\r\n	Все групповые экскурсии – гарантированные, проводятся независимо от количества человек в группе. Процент подтверждения заказов: 99%.\r\n	Мгновенное подтверждение заказов.\r\n	Гарантия качества от TEZ TOUR\r\n\r\n\r\nРазрешенные Гео- весь мир.\r\n\r\nПрисоединяйтесь к партнерской программе Tezeks Many Geos!\r\n\r\n\r\n', NULL, 'https://tezeks.com/', 'https://rzekl.com/g/ksfw82eov452e070baaf85f2e09c3c/', NULL, 'api', '2024-10-24 07:03:14', '2025-01-26 23:00:05', NULL, '48c63ec5-ae03-47e5-87d1-9e340aaa97d2', NULL),
