9a1d2f-fc6e-4082-844a-cdbe6517efed\",\"6857ddf2-e55c-4640-b194-204950ab2ef8\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"8135684a-827b-4322-8872-d0812cbe4b9c\",\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"efced686-40b0-446a-8c7b-96a0610e8372\",\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\",\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\",\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"81864390-a660-477c-82f8-89b3509b7df7\",\"965a312f-f3f4-424c-af32-632860fba509\",\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"dad9da87-890f-427f-9d9b-aa928841ce09\"]', NULL, NULL, 'LightInTheBox - гипермаркет качественных товаров по разумным ценам.\r\n\r\nLightInTheBox - это интернет-магазин одежды, осуществляющий доставку по всему миру. Компания была основана в 2007 году и на сегодняшний день является одним из ведущих участников рынка электронной коммерции.\r\n\r\nLightInTheBox предлагает товары для покупателей по всему миру на своем сайте и в мобильном приложении. Ассортимент продукции компании включает одежду и другие товары общего назначения. Ключевой категорией является одежда, включающая быструю моду и индивидуальную одежду для особых случаев. Другие товары общего назначения включают мелкие аксессуары и гаджеты, товары для дома и сада, игрушки и товары для хобби, электронику и устройства связи и другие товары.\r\n\r\nПреимущества для покупателей:\r\n\r\n- Огромное количество товаров на одном сайте;\r\n- Реальные отзывы клиентов;\r\n- Производство товаров по индивидуальному заказу;\r\n- Низкие цены;\r\n- Международные стандарты качества товаров;\r\n- Доставка по всему миру;\r\n- Разнообразные формы оплаты.\r\n\r\nПреимущества для партнеров:\r\n\r\n- Один из крупнейших реселлеров на рынке электронной коммерции;\r\n- Обширная целевая аудитория;\r\n- Время жизни куки 30 дней;\r\n- Быстрые выплаты;\r\n- Высокие ставки;\r\n- ТОП ГЕО: США, Великобритания, Германия, Канада, Франция;\r\n- Бестселлеры LightInTheBox WW.\r\n\r\nРазмер вашей комиссии будет зависеть от типа вашего трафика:\r\n\r\n\r\n	Стандартная комиссия (кроме сайтов-витрин, купонных сайтов, программ лояльности/кэшбек сервисов и категории “Телефоны и электроника”): 12%\r\n	Кэшбек сервисы/программы лояльности: 10%\r\n	Купонные сайты и сайты-витрины: 8%\r\n	Категория \"Телефоны и электроника\": 8%\r\n	Комиссия за покупку в мобильном приложении: 10%\r\n\r\n\r\nСкачать лого программы можно здесь.\r\n\r\nСкачать список минус-слов можно здесь.\r\n\r\nС Уважением к Вам,\r\nПартнерская программа LightInTheBox', NULL, 'https://www.lightinthebox.com/', 'https://ad.admitad.com/g/383ee6455752e070baaf7d95a12660/', NULL, 'api', '2024-10-24 07:03:14', '2024-10-29 17:30:02', NULL, NULL, NULL),
