аботоспособности сайта;\r\n• стабильная высокая посещаемость сайта: 60 ​​000+ уникальных сессий в день;\r\n• высокая конверсия;\r\n• быстрое внедрение инноваций и исправление багов благодаря работе собственного департамента технической разработки.', NULL, 'https://tickets.kz/', 'https://lsuix.com/g/hbsxldeusj52e070baaf33bdb3e5ab/', NULL, 'api', '2024-10-24 07:03:14', '2025-01-26 23:00:05', NULL, '2c7eac07-6dfa-4c5c-9044-44d6ada70383', NULL),
