нта подачи заявки - от 1 до 60 дней. Таким образом, пока клиент, который перешел по партнерской ссылке и оставил заявку, не получит кредит, ваши заявки будут находиться в статусе \" Ожидает\"  на срок до 60 дней.    \r\n	Все заявки, по которым были выданы кредиты, подтверждаются один раз в месяц, на 31 день с момента выдачи. Обычно до 10 числа месяца, следующего за отчетным.\r\n	Заявки, по которым кредит выдан не был,  находятся с статусе \"Ожидает\" на срок до 60 дней от даты подачи заявки. Если по истечению срока в 60 дней, клиент, который оставил заявку не получит кредит, заявка отклоняется. \r\n	По дополнительным вопросам работы с оффером, обращайтесь в тикеты. \r\n\r\n\r\nОсобенности при создании рекламных материалов.\r\n\r\nВ рекламных материалах и на лендингах вебмастеров, при упоминании процентной ставки, разрешено использовать только вот такую формулировку в дословном ее соответствии:\r\n\r\n\r\n	Ставка вознаграждения от 8% (ГЭСВ от 8,38% годовых). \r\n	Ставку вознаграждения необходимо указывать ТОЛЬКО с ГЭСВ. Указание без ГЭСВ запрещено!\r\n	Если вы не можете указать инфо о ставке с ГЭСВ, уберите упоминание о ставке совсем!\r\n\r\n\r\n \r\n\r\nИнформация о продукте Доверительный кредит:\r\n\r\nВозможность получить максимально быстро средства на сумму до 8 000 000 тенге без комиссий, со страховкой.\r\n\r\n\r\n	Цель кредита - на потребительские цели\r\n	Сумма кредита: от 150 000 до 8 000 000 тенге\r\n	Процентная ставка: от 8% (ГЭСВ от 8,38%) «без комиссий»\r\n	Срок кредита: до 5 лет\r\n	Комиссия за организацию займа 0%\r\n	За досрочное погашение 0%, без штрафных санкций\r\n\r\n\r\nТребование к заемщику:\r\n\r\n\r\n	Возраст на момент предоставления кредита - от 21 года.\r\n	Максимальный возраст - от 21 года, до достижения на момент окончания срока кредита 60 лет для женщин и 63 лет для мужчин\r\n	Стаж работы - не менее 4 мес. на последнем месте работы до даты подачи заявления на получение кредита, при этом общий непрерывный стаж работы физического лица должен составлять не менее 6 месяцев.\r\n\r\n\r\nКак получить кредит:\r\n\r\nДля рассмотрения кредитной заявки необходимы:\r\n\r\n\r\n	Документ, удостоверяющий личность\r\n\r\n\r\nБанк вправе запросить при необходимости дополнительный пакет документов.\r\n\r\nПреимущества кредита:\r\n\r\n\r\n	Без залога и на любые цели;\r\n	Только 1 документ – документ, удостоверяющий личность;\r\n	Отсутствие штрафных санкций за досрочное погашение займа;\r\n	Комиссии отсутствуют;\r\n	Быстрое принятие решения о предоставлении кредита.\r\n\r\n\r\nПортрет клиента: \r\n\r\n\r\n	Муж/Жен -25-50\r\n	Высшее/второе высшее/средне специальное\r\n	Семейное положение- замужем/женат/в разводе/в гражданском браке\r\n	Наличие детей – чем больше детей и иждивенцев в целом, тем меньше шанс прохождения скоринга.\r\n	Сфера деятельности- Нефтегазовый сектор, геология, горнодобывающая промышленность, металлургия, образование, строительство, медицина фармацевтика, органы власти и управления, информационные технологии,\r\n	ЗП от 150К тг. (минимум)\r\n	Стаж работы – на последнем месте работы не менее 2 лет, беспрерывные (6 месяцев) пенсионные отчисления. \r\n	Без просрочки\r\n	ГЕО – все города Казахстана, кроме \r\n	Павлодар \r\n	Кокшетау\r\n	Костанай\r\n	Петропавловск\r\n	Актобе\r\n	Уральск\r\n	При обращении клиенты указывают следующие цели - ремонт дома/квартиры, ремонт машины, покупка машины, на проведение свадьбы, юбилея и тд. Но, в основном просто озвучивают – на личные нужды. \r\n	Получение и обслуживание кредита:\r\n\r\n\r\n\r\n	\r\n		\r\n			\r\n			Порядок получения кредита\r\n			\r\n			\r\n			Единовременно;\r\n			\r\n		\r\n		\r\n			\r\n			Порядок предоставления кредита\r\n			\r\n			\r\n			Единовременное перечисление суммы кредита по заявлению заемщика в день подписания кредитного договора на текущий счет с дальнейшим зачислением денег на счет платежной карточки Mastercard согласно тарифам платежных карт для физических лиц.\r\n			\r\n		\r\n		\r\n			\r\n			Порядок погашения кредита\r\n			\r\n			\r\n			Аннуитетными платежами или дифференцированными платежами.\r\n			\r\n		\r\n		\r\n			\r\n			Частичное или полное досрочное погашение кредита\r\n			\r\n			\r\n			Осуществляется по заявлению, содержащему дату досрочного погашения, сумму и счет, с которого будет осуществляться перечисление денежных средств. Дата досрочного погашения, указываемая в заявлении, должна приходиться исключительно на рабочий день.\r\n\r\n			Минимальный размер досрочно возвращаемого кредита неограничен.\r\n\r\n			Плата за досрочное погашение не взимается.\r\n			\r\n		\r\n	\r\n\r\n\r\nЛицензия от банка для прохождения модерации в рекламных сетях по ссылке.\r\n\r\n ', NULL, 'https://berekebank.kz/', 'https://ntzgd.com/g/1j5n9epgbx52e070baaf7d0ccc2ac3/', NULL, 'api', '2024-10-25 07:03:13', '2025-01-26 22:50:03', NULL, '745463e4-55b0-4f58-b6f4-df8a84447a76', NULL),
