 we search the world for the finest ethically-sourced ingredients to create a range of naturally inspired beauty products.\r\n\r\nToday our dedication to using business as a force for good is stronger than ever. As part of our Enrich Not Exploit™ Commitment, we’ve made it our mission to enrich our products, our people, and our planet. That means working fairly with our farmers and suppliers and helping communities thrive through our Community Trade programme, being 100% vegetarian and always and forever being firmly against animal testing.\r\n\r\nTogether we can do it, it’s in our hands.\r\n\r\nWe look forward to working with you!\r\n\r\nBenefits of The Body Shop Affiliate Program:\r\n\r\n\r\n	Weekly promotions\r\n	Press releases\r\n	Trackable Deep links\r\n	Monthly Discount Codes\r\n	Video Content\r\n	HTML Newsletters & Non-coded newsletters\r\n	Static Text Links\r\n	Product Feed\r\n	Email Blasts\r\n\r\n\r\nCommission rates:\r\n\r\n\r\n	\r\n		\r\n			Commission Group\r\n			Publisher Commission\r\n		\r\n		\r\n			BULK\r\n			0,77%\r\n		\r\n		\r\n			New\r\n			6,15%\r\n		\r\n		\r\n			Guest\r\n			6,15%\r\n		\r\n		\r\n			Existing\r\n			6,15%\r\n		\r\n		\r\n			Luscious Lychee\r\n			6,15%\r\n		\r\n		\r\n			Lime Blossom\r\n			6,15%\r\n		\r\n		\r\n			Vitamin E Day Cream\r\n			15,38%\r\n		\r\n		\r\n			Default\r\n			6,15%\r\n		\r\n	\r\n\r\n\r\n \r\n\r\nLYBC Customer Loyalty Club Benefits:\r\n\r\n\r\n	Rewards: The more customers shop, the more they earn. Get 10 points for every £1 spent. Then when 500 points are earnt customers get a £5 reward\r\n	Events: Customers get invited to exclusive members-only events and sneak previews of The Body Shop new collections.\r\n	Treats: Who doesn’t like a present? We’ll give customers a £5 reward as a birthday treat\r\n', NULL, 'https://www.thebodyshop.com/en-gb/', 'https://ad.admitad.com/g/hidck4r3cm52e070baaf0a9c5c4e41/', NULL, 'api', '2024-10-25 07:03:14', '2025-01-26 23:00:05', NULL, 'c7279889-b6a9-4bf3-b97b-f9fa27030fc5', NULL),
('96579983-8738-4b26-9c84-45ea094f4ce7', NULL, 29334, 86725619, NULL, 'Baytonia SA promo codes', 'USD', '56', NULL, '4', NULL, NULL, 'Admitad', 'logos/baytoniasapromocodes.svg', 'https://cdn.admitad-connect.com/campaign/images/2024/1/5/29334-82642d6432ab3ebc.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '3.5', '140350%', '90', 0, 0, 0, 0, 1, 0, NULL, '[\"Saudi arabia\"]', '\"[\\\"a4ba22bc-1810-44af-8f33-ac18412b5464\\\",\\\"8804ede6-cf7b-4b1c-8fb8-703d7450bc23\\\"]\"', '\"[\\\"SA\\\"]\"', NULL, '[\"31a83c2d-125c-40f7-a949-ed8229662e60\"]', '\"[\\\"42c36461-beca-4c52-9570-375bb129e816\\\",\\\"643459ce-2619-4819-8a3d-b319aab69d27\\\",\\\"a5fd5a2f-cf5b-4731-a9ea-424696aa63a9\\\",\\\"901c1214-e315-4269-b691-e7e23124bb5f\\\",\\\"539a1d2f-fc6e-4082-844a-cdbe6517efed\\\",\\\"6857ddf2-e55c-4640-b194-204950ab2ef8\\\",\\\"b3c43963-4397-414e-ad68-19c161924ef1\\\",\\\"dad9da87-890f-427f-9d9b-aa928841ce09\\\",\\\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\\\",\\\"efced686-40b0-446a-8c7b-96a0610e8372\\\",\\\"6accedd5-a1f6-4a96-af67-ad2b7bf02a53\\\",\\\"f6cfb4ab-0a4a-410f-b62a-e554d3ac0960\\\",\\\"17b490eb-600b-4cbe-b1ff-41bc67f4c60e\\\",\\\"35224500-7f53-44ce-a774-d5e2299b9f95\\\",\\\"c88534a9-07a1-4153-b2d3-7c784897d752\\\",\\\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\\\",\\\"8135684a-827b-4322-8872-d0812cbe4b9c\\\",\\\"2c50b44b-cddd-4685-8db7-6511bde6cd38\\\",\\\"81864390-a660-477c-82f8-89b3509b7df7\\\",\\\"965a312f-f3f4-424c-af32-632860fba509\\\",\\\"6e3f8e5e-2bf8-4766-86ce-1dce1a143103\\\",\\\"6e704421-6015-49fd-ba15-f946556e6e62\\\",\\\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\\\",\\\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\\\",\\\"675670ac-6c51-45cb-bb40-1b16849e9d98\\\"]\"', NULL, NULL, 'Baytonia is a website that deals with everything related to the home\r\n\r\nOur story:\r\n\r\nBaytonia is the story of the two friends, Karam and Ibrahim’s passion for home furniture, and their realisation that the spirit of the house is reflected on its owners.\r\n\r\nThe story begins in the year 2014, when Karam thought of establishing his own business in the field of home accessories and furnishings because of his intense passion for them, which started from his early childhood when he started working with his father in this field. Many problems and obstacles prevented him from realising his idea. and forced him Disregard it and forget it.\r\n\r\nTwo years later, his best friend Ibrahim found the girl of his dreams, and decided to marry her. Ibrahim began preparing the necessary equipment for his new life, and decided to design his house in a special and very distinctive way; Because of his interest and fondness for small details. Karam had noticed the difficulties he was facing Ibrahim is on a search mission The choice is especially due to the limited time available and the quality of the products available in the local market, and he wishes he could help.\r\n\r\nIbrahim also travels a lot due to his work conditions, which gave him the opportunity to visit many home furniture stores and made him passionate about them. He noticed in his many visits that Spain is interested in ancient Islamic geometric shapes and decorations, while the Netherlands is interested in making ceramics in a distinctive and beautiful manner, and all this is completely different in Britain is known for its diverse designs. And wandering around any city he visits to acquire some unique pieces and home accessories has become his new fun habit, but his joy was not complete because of his fear of shipping problems or their arrival in a bad condition, so Karam shared his concerns to find a solution together.\r\n\r\nBecause of Karam and Ibrahim’s belief and realisation that the design of the house, its arrangement and the beauty of its pieces reflect on the people of the house and their general mood first, they decided together to provide the most beautiful household pieces from all over the world and make them available to everyone to increase their comfort and happiness in their homes. And from here The birth of “Baytonia” was; To be the closest and easiest way to acquire home accessories and furnishings, and reach every home in an elegant manner without facing any problems. \r\n\r\nNow we are in Team Petunia, where we find inspiration in exciting products with creative and eye-catching designs. With new designs and distinctive products, we present them to you on our website and we work hard to be developed on a permanent and continuous basis. Our first mission is to provide the site with everything new in the world of household products with attractive and distinctive ideas to suit your taste.\r\n\r\n \r\n\r\nWhy Baytonia?\r\n\r\nDistribution of the beautiful feeling has been the center of attention since day one, contemplating the most beautiful creatures in the world Nothing compares to the beauty of flower and the charm of its details. In our extensive search in the names of flowers we found the name of a flower with deep meaning. “Petunia” has a beautiful color and is one of the most attractive flowers. And the most beautiful thing is that her name contains many wonderful details: the first part of her name symbolises [Beit], while the second part [Nia] is a common name in Georgia that symoolizes many meanings such as “goal, purpose, radiance, and brilliance.” We found that this name It reflects many of our goals and objectives and what we aspire to, that our products decorate the homes of our customers and make them shine brighter of another kind.\r\n\r\nOur goals:\r\n\r\n\r\n	Sharing with every home our creations and facilitating the acquisition of beautiful, exclusive and distinctive pieces.\r\n	Choosing high quality brands and adding wide assortments by our experts in an innovative and beautiful way.\r\n	Enhance and create choices for good taste and add attractive touches for a more elegant and tidy home.\r\n	Facilitating the shopping service for all corners of the house through our website to be available to everyone.\r\n\r\n\r\nOur products:\r\n\r\nIn Baytonia, we do not only choose beautifully shaped products, but we try to choose the latest designs from the best international brands specialised in home accessories and parts; Because we believe that the secret of our success is excellence and the provision of high quality products, all according to different customer service.\r\n\r\nDelivery:\r\n\r\nWe can deliver the products to your home as soon as possible through shipping companies (Aramex - Silex), and we promise to ship your order from our warehouse within a maximum period of 7 working days.\r\n\r\nReturn and Exchange:\r\n\r\n\r\n	Return and exchange service is available for a period of 3 days from the time of ordering, provided that the product is returned in its original condition .\r\n	When you report any problem or damage in the product during the shipping service, we will immediately send you another new and clean shipment.\r\n	\r\n	Customer insighnts:\r\n	Our customers\' age ranges from 25 years, and above with a gender distribution of 70% female and 30% male. In terms of device usage, approximately 90% of our customers using iOS and mobile, while the remaining 10% using Android and desktop.\r\n	 \r\n', NULL, 'https://baytonia.com/', 'https://ficca2021.com/g/3ihk802a7752e070baaf9a068958bb/', NULL, 'api', '2024-10-25 07:03:14', '2025-01-26 22:50:03', NULL, '96579983-8738-4b26-9c84-45ea094f4ce7', NULL),
