('07bccc30-4aa2-4f76-bfa2-64cb634e8a57', NULL, 28680, 56150105, NULL, 'Mark Formelle KZ', 'BYN', '31', NULL, NULL, NULL, NULL, 'Admitad', 'logos/markformellekz.svg', 'https://cdn.admitad-connect.com/campaign/images/2022/5/25/28680-bee742b2875addd0.svg', 1, 'Not Found', NULL, NULL, NULL, NULL, NULL, NULL, '3', '300%', '30', 1, 1, 0, 0, 1, 0, NULL, '[\"Kazakhstan\"]', '[\"a4ba22bc-1810-44af-8f33-ac18412b5464\",\"939b006d-a2c8-4488-b158-251855c5bda5\",\"0d6a7c0b-bffe-483c-9948-2e058d77a199\"]', '[\"KZ\"]', NULL, '[\"1dc6a827-6b1e-4d04-bdaa-674a6386ecba\",\"905cfbab-8365-4fad-b07a-6b9c96c9e51b\",\"31a83c2d-125c-40f7-a949-ed8229662e60\"]', '[\"dad9da87-890f-427f-9d9b-aa928841ce09\",\"81864390-a660-477c-82f8-89b3509b7df7\",\"42c36461-beca-4c52-9570-375bb129e816\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"643459ce-2619-4819-8a3d-b319aab69d27\",\"c88534a9-07a1-4153-b2d3-7c784897d752\",\"a2c20ea0-c6c5-4929-bb9d-89c64c2b3143\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"b3c43963-4397-414e-ad68-19c161924ef1\",\"35224500-7f53-44ce-a774-d5e2299b9f95\",\"efced686-40b0-446a-8c7b-96a0610e8372\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"2c50b44b-cddd-4685-8db7-6511bde6cd38\",\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\"]', NULL, NULL, '\r\n\r\n* В бонусной программе принимают участие все вебмастера.\r\nУсловия: при 70+ подтвержденных заказов за июнь вы получаете к ставке +20%\r\n\r\nО КОМПАНИИ:\r\n\r\nМы – Mark Formelle, белорусский бренд стильной одежды для всей семьи, законодатель домашней моды, носочный эксперт. Mark Formelle создан в 2009 году супругами и партнерами по бизнесу Светланой Сипаровой и Андреем Сериковым. С тех пор уже более 10 лет мы производим одежду для дома, жизни и спорта, чтобы сделать ваш день ярче.\r\nВ Казахстане фирменные магазины Mark Formelle можно найти в 13 крупных городах. Интернет-магазин markformelle.kz предлагает множество вариантов доставки в эти и другие города. Важной особенностью нашей работы в Казахстане является наличие белорусской косметики – натуральной и качественной.\r\n\r\nСегодня Mark Formelle – это:\r\n\r\n\r\n	17 собственных фабрик;\r\n	220+ фирменных магазинов в 4 странах мира;\r\n	170+ капсульных коллекций в год;\r\n	26 млн изделий выпускается и продается ежегодно.\r\n\r\n\r\nПортрет целевой аудитории:\r\n\r\n\r\n	женщины 25-35 лет – 75%\r\n	мужчины 25-35 лет – 25%\r\n	проживание – город\r\n	семейное положение – в браке/отношениях\r\n	уровень дохода – средний\r\n\r\n\r\nНаше ГЕО:\r\n\r\n\r\n	Беларусь – 63%\r\n	Россия – 17%\r\n	Казахстан –  11%\r\n\r\n\r\nНаши преимущества:\r\n\r\n\r\n	Мы – Бренд №1 в Беларуси\r\n	Инновации и контроль качества\r\n	Более 780 оптовых партнеров в 13 странах мира;\r\n	Более 1 100 000 подписчиков в социальных сетях;\r\n	Интернет-магазин с различными видами доставки.\r\n', NULL, 'https://markformelle.kz/', 'https://dhwnh.com/g/rjrch3dm8r52e070baaf6336e2e1d2/', NULL, 'api', '2024-10-25 07:03:14', '2024-10-29 17:30:02', NULL, NULL, NULL),
