ns up after 90 days and then purchases a plan during the next 90 days will be attributed to the partner.\r\n\r\nHere you can find the description of each plan`s advantages \r\n\r\nWhen signing up via a referral link and purchasing a subscription, the new user receives a $15 bonus. This bonus is paid in TradingView coins after the furt purchase and can be used to buy the next subscription.\r\n\r\nThe payouts are made once a month after a 30-days hold period, This means that the commissions for January are paid in late February - early March, commissions for February - in late March, early April etc.\r\n\r\nBanners - https://drive.google.com/file/d/1EUqor8H6idfxeoPlUUaOE6d63vvx6-gn/view\r\n\r\n ', NULL, 'https://www.tradingview.com/', 'https://xnmik.com/g/ci6u29gmgm52e070baaf14dc832513/', NULL, 'api', '2024-10-26 07:04:09', '2025-01-26 23:00:05', NULL, '58953819-6f31-4cc1-9b5a-0a8fb0528f8c', NULL),
