ии и скидки на товары\r\n	Быстрая доставка в любой уголок Украины\r\n', NULL, 'https://medmag.ua/', 'https://ad.admitad.com/g/4puec3155r52e070baafe4bdeeca69/', NULL, 'api', '2024-10-26 07:03:15', '2025-01-26 22:50:07', NULL, 'a2023c44-5185-435c-9c6d-75aa2f0da640', NULL),
