d-b319aab69d27\",\"539a1d2f-fc6e-4082-844a-cdbe6517efed\",\"d8540005-dc71-457c-8ea6-fcc2bb2a0a0e\",\"e6e46e6f-29fa-414f-bb01-1a3e2b0ad01b\",\"675670ac-6c51-45cb-bb40-1b16849e9d98\",\"792caceb-d32c-4ecd-85f7-f4c0426b84b6\",\"efced686-40b0-446a-8c7b-96a0610e8372\",\"6e704421-6015-49fd-ba15-f946556e6e62\",\"b3c43963-4397-414e-ad68-19c161924ef1\"]', NULL, NULL, 'Подключайтесь к партнерской программе GamersBase!\r\n\r\nGamersBase - лучший магазин компьютерных игр от создателей Gama-Gama.\r\n\r\nВ магазине популярные и интересные игровые бестселлеры представлены тысячами известных проектов и десятками лучших производителей игр на PC, Mac и Xbox.\r\n\r\nНаш интернет магазин компьютерных игр специализируется на продаже ключей уже не первый год. Многолетний опыт работы в этом направлении позволил сделать сервис максимально удобным и простым, а процедуру покупки приятной и невероятно легкой! Все еще сомневаетесь в том, что качественные видеоигры можно купить в магазине видеоигр онлайн? Попробуйте и Вам обязательно понравится!\r\n\r\nПреимущества для покупателей:\r\n\r\n\r\n	Интернет-магазин игр на PC GamersBase гарантирует качество каждого продаваемого товара;\r\n	Игры на PC на 100% лицензионны (GamersBase сотрудничает с ведущими издателями игр в России и в мире);\r\n	Гарантируется полный возврат денег, если приобретенный ключ окажется недействующим либо предложим заменить его на новый;\r\n	Круглосуточная поддержка. Возможно связаться онлайн, по телефонам или оставив заявку на сайте.\r\n\r\n\r\nПреимущества для вебмастеров:\r\n\r\n\r\n	Высокая ставка по вознаграждениям - 10%;\r\n	Время жизни cookies - 30 дней;\r\n	Время холда - 30 дней;\r\n	Широкий выбор разрешенных источников трафика.\r\n\r\n\r\nДля оперативного информирования об изменениях и новостях игровых офферов подписывайтесь на телеграм-канал Admitad Games!', NULL, 'https://gamersbase.store/', 'https://lsuix.com/g/nzstwno2sa52e070baafb0de1ddd64/?erid=LatgC2Zh5', NULL, 'api', '2024-10-26 07:03:15', '2024-10-29 17:30:02', NULL, NULL, NULL),
