ть боя при сохранении высокого вклада каждого участника в победу команды. Пехота, бронетехника и авиация сражаются вместе, и за одну игровую сессию вы можете попробовать сразу несколько ролей.\r\n\r\nОсобенности игры:\r\n\r\n\r\n	Эпические массовые сражения, которые выглядят столь же масштабными, как и исторические сражения, такие как высадка на пляж в Омахе.\r\n	Высокий вклад каждого игрока в командную победу: Несмотря на масштабность сражений, результат во многом определяется способностями каждого игрока.\r\n	Разнообразие игровых ролей и возможность переключаться между ними на лету: в одну минуту вы штурмуете окопы противника из пистолета-пулемета, в следующую вы прячетесь на крыше со снайперской винтовкой, а также можете прыгнуть в танк, чтобы прорвать оборону, бросить гранаты в машину противника или оказать поддержку с воздуха своим товарищам по команде.\r\n	Enlisted выглядит аутентично даже в мельчайших деталях, таких как внешний вид солдат и строений или модель повреждений танка. Список транспортных средств и оружия, доступных в определенных миссиях, также основан на реальной истории, поэтому вы не можете использовать оборудование 1945 года в битве 1941 года.\r\n	Игрок может настраивать и обучать отряды в соответствии со своим индивидуальным стилем игры, разблокировать перки и улучшения, если это не противоречит принципу исторической точности.\r\n\r\n\r\nЦелевая аудитория:\r\nВозраст: 18–45\r\nПол: ~90% мужской\r\nИнтересы к играм FPS, Стратегиям, Военным / симуляторам, военной технике, оружию, истории Второй мировой войны\r\n\r\n \r\n\r\n \r\n\r\nКРЕАТИВЫ\r\n\r\n\r\n \r\n\r\nВ программе действует Hard KPI: Не менее 7% регистраций должно быть конвертировано в логины. В противном случае заработок веба может быть отклонен.\r\nЗапрещён любой SEM трафик.\r\nЗапрещен трафик из России и стран СНГ.\r\nТестовый лимит - 100 регистраций до получения обратной связи.\r\n\r\n \r\n\r\n\r\n\r\n\r\n', NULL, 'https://enlisted.net/en/', 'https://plrvq.com/g/83kvjymdy652e070baafae9a5214fd/', NULL, 'api', '2024-10-26 07:03:15', '2025-01-26 22:50:05', NULL, 'b1f56784-5243-48cc-996d-530cb720c61a', NULL),
